(8, 'Launching Uji Coba Gerai Pelayanan Perizinan Sektor Kelautan dan Perikanan', 'Selasa - 22 November 2016 telah dibuka Uji Coba Gerai Pelayanan Perizinan Sektor Kelautan dan Perikanan oleh Sekretaris Daerah Kabupaten Ketapang yang diwakili oleh Drs. Heronimus Tanam, ME (Asisten Sekda Bidang Administrasi Umum) yang bertempat di PPI Sukabangun kab. Ketapang. Launching tersebut dihadiri oleh Kepala Badan Penanaman Modal dan Pelayanan Terpadu Satu Pintu (BPMPTSP) Provinsi Kalimantan Barat, dengan undangan Kepala Dinas Kelautan dan Perikanan Provinsi Kalimantan Barat, Kepala Dinas Kelautan dan Perikanan dan Kepala Dinas / Kantor Unit PTSP (Kubu Raya, Mempawah, Sambas, Singkawang, Bengkayang, Kayong Utara). Kepala KSOP Kelas V Kab. Ketapang, Kepala PPI Sukabangun, Kepala PPI Tanjung Satai,&nbsp;Kepala PPP Telok Batang dan para nelayan disekitar.\\n<br/>\\nPada Sambutan Kepala BPMPTSP Prov. Kalbar mengatakan guna mendekatkan pelayanan kepada masyarakat mengacu perubahan kewenangan Pemerintah Pusat, Pemerintah Provinsi dan Pemerintah Kab/Kota berdasarkan Undang-Undang No 23 tahun 2014 tentang Pemerintahan Daerah&nbsp;teruma dalam pengurusan perizinan sektor kelautan dan perikanan, maka dibuka uji coba gerai pelayanan yang akan dilaksanakan di 3 (tiga) kabupaten yaitu Ketapang, Mempawah dan Sambas. Uji coba di Ketapang akan dilaksanakan dari Selasa tanggal 22 November s/d Jum\\\'at 25 November 2016 yang kemudian akan diefektifkan pada tahun 2017.<br/>Sekda Kabupaten Ketapang menyambut baik penyelenggaraan&nbsp;uji coba Gerai Pelayanan Perizinan ini. Dengan perubahan kewenangan pengurusan izin terutama untuk izin penangkapan ikan dengan kapal berukuran 10 GT yang pada awalnya diserahkan kepada kab/kota sekarang diserahkan pada provinsi&nbsp;tentu akan menimbulkan kendala bagi para nelayan dalam pengurusan izin, baik itu waktu pengurusan, maupun biaya yang harus dikeluarkan untuk mengurus. Dengan adanya Gerai Pelayanan Perizinan ini diharapkan akan memberikan dampak yang positif dan mendorong masyarakat untuk mengurus perizinan. Harapan lain yang disampaikan Sekda&nbsp;dalam launching uji coba gerai ini agar setiap kapal memiliki izin untuk penangkapan ikan dan kedepannya tidak ada lagi hambatan dalam melakukan usaha penangkapan ikan, dokumen telah lengkap, izin dan dokumen sesuai dengan kondisi kapal sehingga masyarakat aman dalam melakukan aktivitas melaut.<br/>Himbauan kepada seluruh masyarakat/nelayan di Kabupaten Ketapang dan Kabupaten Kayong Utara untuk memanfaatkan uji coba gerai pelayanan perizinan ini .', '2017-04-25 04:33:00', 0x6173736574732f6265726974612f336631353739386565363964333937393331626136313465613833646535353535373161633664636630386666656366393739366362393730366337356565632e6a7067, 'Pelayanan Perizinan Sektor Kelautan dan Perikanan'),
(9, 'Pendataan dan Monitoring Izin Usaha di Wilayah Kecamatan Delta Pawan', 'Ketapang, Pada tanggal 5 s/d 30 September 2016, Berdasar Surat Keputusan Bupati Ketapang No. 456/KPT-C/2015 tentang Tim Pengawasan dan Pengendalian Perizinan Kantor Pelayanan Terpadu Kabupaten Ketapang. <br/>Kantor Pelayanan Terpadu Kabupaten Ketapang melakukan Pendataan dan Monitoring Kelengkapan Izin Usaha setiap kegiatan usaha di wilayah Kecamatan Delta Pawan, pendataan ini difokuskan pada jalan utama jalur perdagangan dan jasa di Kota Ketapang. Kegiatan tersebut bertujuan untuk mensukseskan penataan kota yang baik dan tertib usaha dengan memiliki IMB (Izin Mendirikan Bangunan) dan Izin Usaha. <br/>Semoga ke depan setiap warga Ketapang sadar akan pentingnya perizinan guna penataan Ketapang menjadi lebih baik.', '2016-11-28 19:23:46', 0x6173736574732f6265726974612f336631353739386565363964333937393331626136313465613833646535353538396133376332396561373335666661316661306565613862333834663037342e6a7067, 'Pendataan dan Monitoring'),
(10, 'Tinjauan BKPM dan BPMPTSP Prov. Kalbar ke Kayung Agro Lestari dan Borneo City Mall Ketapang', '&nbsp;', '2016-11-28 18:28:42', 0x6173736574732f6265726974612f336631353739386565363964333937393331626136313465613833646535353534613634653363386638356661363632353836653839393862336139626237372e6a7067, 'Tinjauan BKPM dan BPMPTSP'),
(11, 'Pendampingan Tim Pengendalian BKPM ke PT. Arrtu Plantation dan PT. BSM New Material', '29 s/d 30 November 2016 - Pejabat BKPM didampingi tim pengendalian BPMPTSP Provinsi Kalimantan Barat melakukan peninjauan lapangan terkait perkembangan penanaman modal pada&nbsp;PT. Arrtu Plantation dan PT. BSM New Material di Kecamatan Tumbang Titi dan Kecamatan Delta Pawan. Pada kegiatan tersebut selain peninjaun perkembangan pembangunan&nbsp;Bapak A. Qodir selaku Kepala Seksi Sektor Sekunder Wilayah DIY dan Kalbar,Direktorat Wilayah II,&nbsp;Ibu Evi Y. Salim, Kasi Sektor Primer dan Tersier, Subdit Wilayah DIY dan Kalimantan Barat, pendamping dari BPMPTSP Provinsi, Plt. Kepala Kantor Pelayanan Terpadu (KPT), Kasi Pengaduan KPT, dan perwakilan Bagian Ekonomi Setda Ketapang juga memberikan arahan dan diskusi bersama untuk mengatasi hambatan yang dialami investor.', '2016-12-03 09:09:21', 0x6173736574732f6265726974612f346662343763363662613761396532623662366237303062303463383937356533363039393738353138623364336437653166643664313433643034633938612e6a7067, 'Pendampingan Tim Pengendalian BKPM ke PT. Arrtu Plantation dan PT. BSM New Material'),
(12, 'Kantor Pelayanan Terpadu Pindah Alamat', '<p>Senin, 19 Desember 2016, Kantor Pelayanan Terpadu sudah mulai melaksanakan aktifitas pelayanan di Gedung barunya di jalan Letjend. S. Parman No. 109 tepat nya di lokasi kantor lama tepat berhadapan dengan Kodim 1203/Ketapang.</p><p>Pada gedung baru ini, KPT sudah memberlakukan sistem FO (Front Office) dan BO (Back Office). Harapan kedepan pelayanan pada KPT sesuai dengan keinginan masyarakat Kabupaten Ketapang. aamiin.</p>', '2016-12-19 09:03:56', 0x6173736574732f6265726974612f313965623531336265613237633966333938303336666433613061663038626635643434313938386233613635353238313162363631373731383937646264332e6a7067, 'FO dan BO KPT'),
(13, 'Peresmian Gedung Kantor dan Launching SMS Gateway SIMPELPADU', '<p>Pada hari ini, Jum\'at 23 Desember 2016. Bupati Ketapang didampingi Wakil Bupati Ketapang meresmikan penggunaan Gedung Kantor Pelayanan Terpadu bersamaan dengan Launching SMS Gateway SIMPELPADU. Pada acara tersebut t hadir Sekretaris daerah, Asisten Sekda, Staf Ahli Bupati, Unsur Forkopimda, Kepala Badan/ Dinas/ Kantor/ Bagian dilingkungan Pemerintah kabupaten Ketapang, Kepala Instansi Vertikal.<br></p><p>Dalam sambutannya, Bupati berpesan kedepannya Kantor Pelayanan Terpadu atau Dinas Penanamam Modal dan Pelayanan Terpadu Satu Pintu yang akan datang harus dapat terus memberikan ekseistensinya dibidang pelayanan, profesional sebagai aparatur pemerintah, lebih inovatif dan kreatif dalam memberikan pelayanan termasuk pengembangan pelayanan berbasis sistem informasi, lebih produktif dalam berkerja dan konsisten terhadap dasar-dasar pelayanan publik agar pelayanan prima dapat terwujud kepada masyarakat.</p><p>Gedung kantor dan launching SMS Gateway SIMPELPADU diresmikan dengan ditandai dengan Penanda Tanganan Prasasti dan Pengguntingan Pita. Semoga Pelayanan kantor Pelayanan Terpadu semakin baik dan memberikan rasa kepuasan kepada masyarakat.</p>', '2016-12-23 12:42:46', 0x6173736574732f6265726974612f393735363164656464323830383139376533613264343837333034393234376431343661346534633966643238356365376134313731393734356564376666362e6a7067, 'Peresmian Gedung Kantor dan Launching SMS Gateway SIMPELPADU'),
(14, 'Website KPT sedang dalam perubahan ke DPMPTSP', '<p>mohon maaf atas ketidaknyamanannya sementara waktu kami belum updatenya informasi, dikarenakan website sedang dalam perubahan Kantor Pelayanan Terpadu menjadi Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu. Akan tetapi persyaratan dan formulir permohonan masih dapat didownload pada menu perizinan.</p><p>Terima kasih.</p><p>admin</p>', '2017-01-13 09:07:26', 0x6173736574732f6265726974612f626365383733643737366132306331343135353938633261633365653836376637383864386563666161366239663436306636363763623637663366616639612e6a7067, 'Website KPT sedang dalam perubahan ke DPMPTSP'),
(15, 'Pelantikan Pejabat Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu', '<p>Diawali dengan pelantikan Sekretaris Daerah Kabupaten Ketapang Drs. H.M. Mansyur, M.Si, sejumlah pejabat eselon II dan III juga dilantik pada tanggal 3 Januari 2017 pukul 14.00 WIB. Sedangkan pejabat eselon IV dilantik pada tanggal 6 Januari 2017. Pada pelantikan tersebut Kantor Pelayanan Terpadu (KPT) yang telah berubah kelembagaan menjadi Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu (DPMPTSP) juga dilantik pejabatnya oleh Bupati Ketapang. Pejabat-pejabat tersebut antara lain:</p><p>Suryanto AR, SH (Kepala DPMPTSP);</p><p>H. Dennery, ST, MT (Sekretaris), Epi Karnadi, S.ST (Kasubbag. Penyusunan Program dan Keuangan), Nurjanah, S.Sos (Kasubbag. Umum dan Kepegawaian);</p><p>Muhammad Subhi, S.IP (Kepala Bidang Pengembangan Penanaman Modal), Safarudin, SE (Kasi Promosi), Adi Syuriansyah, SE (Kasi Pengembangan Penanaman Modal);</p><p>Maryanto, S.Sos, MM (Kepala Bidang Data dan Pengendalian), MF. Yuliansyah, ST (Kasi Data dan Informasi Penanaman Modal), Zairina, SE (Kasi Pengendalian);</p><p>Rio Marisa, S.STP (Kepala Bidang Pelayanan Perizinan Terpadu), Herwan, ST (Kasi Pelayanan Perizinan dan Non Perizinan bidang A), Ridhwan, SP (Kasi Pelayanan Perizinan dan Non Perizinan bidang B), Khadi Fitriadi, S.IP (Kasi Pengembangan Kapasitas Pelayanan Perizinan).</p><p>Semoga dengan telah dilantikanya pejabat di DPMPTSP pelayanan perizinan kepada masyarakat, penataan kegiatan usaha, tata kota dan pertumbuhan penanaman modal di Ketapang semakin baik dan berkembang.</p>', '2017-04-25 04:32:55', 0x6173736574732f6265726974612f353634326635373162376534363762613130633134356535666235646132363133376161373631316437313835333762396338636634356166636664343835362e6a7067, 'Pelantikan Pejabat SOPD Baru Kabupaten Ketapang'),
(16, 'Daftar Ulang Izin Gangguan Tanpa Biaya', '<p>Merujuk Surat Bupati Ketapang Nomor 045.2/0591/Hukum-A tanggal 14 maret 2017 perihal Penghentian Penarikan Retribusi Daftar Ulang Izin Gangguan yang merujuk Surat Keputusan Menteri Dalam Negeri Nomor 188.34-9685 Tahun 2016 tentang Pembatalan Beberapa Ketentuan Peraturan Daerah Kabupaten Ketapang Nomor 12 Tahun 2013 tentang Izin Gangguan dan Retribusi Izin Gangguan, maka mulai SK tersebut diterima, Penarikan Retribusi Daftar Ulang Izin Gangguan dihentikan.<br></p><p>Informasi ini disampaikan untuk diketahui oleh seluruh Masyarakat Kabupaten Ketapang, khususnya kepada masyarakat yang memiliki usaha di wilayah Kabupaten Ketapang. Kemudian tidak lupa kami menghimbau bagi masyarakat yang memiliki kegiatan usaha untuk mengurus izin  yang sesuai dengan kriteria usaha sebagai kekuatan hukum usaha, tertib administrasi usaha dan data pemerintah dalam pemetaan usaha maupun investasi daerah.</p>', '2017-03-16 06:44:39', 0x6173736574732f6265726974612f386364336231373833353966333737363136653930366439613137396532353336316234323538353634646233326230623636333435306638636661353463632e6a7067, 'Daftar Ulang Izin Gangguan Gratis'),
(17, 'Penyesuaian Waktu Operasional Selama Bulan Suci Ramadhan', '<p>Sehubungan dengan Bulan Suci Ramadhan, Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu melakukan penyesuaian waktu operasional pelayanan perizinan. Adapun waktu operasional pelayanan perizinan Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu selama Bulan Suci Ramadhan adalah hari Senin s/d Jumat dari pukul 08.15 s/d 15.00 WIB. Diinformasikan pula waktu istirahat selama Bulan Suci Ramadhan yaitu hari senin s/d kamis pukul 12.00 – 12.45 WIB,&nbsp; khusus hari jumat pada pukul 11.00 – 12.45 WIB.</p><p>Kami mengucapkan “Selamat Menunaikan Ibadah Puasa 1438 H”</p>', '2017-06-02 06:28:42', 0x6173736574732f6265726974612f333237613835336136383262616635373139356366363965303430333939313133613066616263326333376464303366383963613535666631313564613536352e6a7067, 'Penyesuaian Waktu Operasional Selama Bulan Suci Ramadhan'),
(18, 'Rapat Internal Pembahasan Perizinan', '<p>Pada hari Rabu tanggal 31 Mei 2017, Bidang Pelayanan Perizinan Terpadu Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu menggelar rapat internal pembahasan mengenai harmonisasi regulasi perizinan. Rapat yang dipimpin oleh Kepala Bidang Pelayanan Perizinan Terpadu didampingi oleh Kasi Pelayanan Perizinan dan Non Perizinan Bidang A serta Kasi Pengembangan Kapasitas Pelayanan Perizinan dan diikuti oleh Kasi Pengendalian Pelaksanaan Penanaman Modal Bidang Data dan Pengendalian Penanaman Modal serta beberapa staf bidang pelayanan perizinan terpadu Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang.</p><p>Dalam rapat ini dilakukan pengkajian dan pembahasan peraturan-peraturan pendukung pelaksanaan pelayanan perizinan yang telah di inventarisasi baik peraturan lama yang masih berlaku maupun yang telah mengalami revisi. Hal ini dilakukan untuk merumuskan, menyusun dan mengevaluasi peraturan-peraturan pendukung perizinan yang sesuai dengan kemampuan dan kondisi masyarakat serta lingkungan di Kabupaten Ketapang.</p><p>Kabid Pelayanan Perizinan Terpadu juga menekankan kepada jajaran staf Bidang Pelayanan Perizinan Terpadu untuk mengakomodir pemberian fasilitas kemudahan kepada pelaku usaha baik dalam melengkapi persyaratan, pengurusan ijin maupun pembayaran retribusi dalam peraturan petunjuk teknis.&nbsp;</p>', '2017-06-07 04:20:07', 0x6173736574732f6265726974612f376133623663346265343362376530663134616134626436613134323263633831373365323635316561623466616632643863313463356533666638663161302e6a7067, 'Rapat Internal Pembahasan Perizinan'),
(21, 'Selamat Idul Fitri 1438 H', '<p>Sehubungan dengan dimulainya cuti Hari Raya Idul Fitri (cuti bersama) pada hari Jumat tanggal 23 Juni 2017 s/d 30 Juni 2017 dan memulai aktivitas kembali pada tanggal 3 Juli 2017 maka Kami Keluarga Besar Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu mengucapkan :</p><p>“Selamat hari raya Idul Fitri 1438H</p><p><strong>Taqabalallahu minna wa minkum, minal aidin wal faidzin</strong>,</p><p>mohon maaf lahir dan bathin”</p><p><br></p><p><br></p><p>ttd</p><p>Kepala DPMPTSP</p><p><br></p>', '2017-06-22 07:47:29', 0x6173736574732f6265726974612f383731353062353430363864316536316631666339333463306264643135616639323439353062376234643037666662366266383033306639323964343839392e6a7067, 'Selamat Idul Fitri 1438 H'),
(22, 'Rapat Staff dan Acara Halal Bihalal DPMPTSP', '<p>Pada hari Senin, tanggal 03 Juli 2017 Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu melaksanakan rapat staff dilanjutkan dengan acara Halal Bihalal pacsa Hari Raya Idul Fitri 1438 H di ruang rapat Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang.<br></p><p>Rapat dipimpin oleh Kepala Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang, Suryanto AR, SH dan dihadiri oleh seluruh pegawai Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu. Rapat ini membahas evaluasi kinerja pegawai serta tupoksi masing-masing pegawai yang harus dilaksanakan dalam rangka peningkatan kualitas pelayanan yang diberikan oleh Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang.</p><p>Dalam rapat ini juga dilakukan diskusi dan pembahasan mengenai apa saja kekurangan yang perlu dibenahi dan bagaimana upaya memberikan pelayanan yang baik bagi masyarakat. Setelah itu, acara dilanjutkan dengan Halal Bihalal dengan kegiatan bersalam-salaman diantara seluruh pegawai Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang.<br></p>', '2017-07-04 01:56:45', 0x6173736574732f6265726974612f326537316164386465373432353237306136383937316430353065336539353430313235366466316166383563366330613661656361663138636263653837332e6a7067, 'Rapat Staff dan Acara Halal Bihalal DPMPTSP'),
(23, 'Pembukaan Ketapang Expo 2017', '<p>Bupati Ketapang Martin Rantan, SH resmi membuka Ketapang Expo 2017, pada hari Selasa tanggal 11 Juli 2017 di halaman Pendopo Bupati Ketapang sebagai rangkaian pesta rakyat Kabupaten Ketapang dengan tema “Melalui Ketapang Expo 2017 mari kita manfaatkan Sumber Daya Alam dengan sebaik-baiknya guna meningkatkan Ekonomi Daerah Ketapang yang maju menuju masyarakat sejahtera”. Ketapang Expo ini merupakan ajang rutin tahunan sebagai wadah untuk menampilkan produk-produk unggulan dan potensi daerah.</p><p>Ketapang Expo 2017 kali ini sangat meriah dilihat dari antusias para peserta Ketapang Expo dan masyarakat yang mengunjungi stand-stand pameran. Adapun peserta dari Ketapang Expo 2017 terdiri dari 28 unsur SKPD, 20 Kecamatan, 35 Lembaga Vertikal, BUMN, Perbankan, Perusahaan, Organisasi Wanita, Organisasi Masyarakat, Organisasi Sosial, Koperasi dan Perguruan Tinggi, serta 172 Pedagang Kaki Lima (PKL). DPMPTSP tergabung dalam satu stand bersama Sekretariat Daerah, Badan Pendapatan Daerah dan Dinas Kependudukan dan Pencatatan Sipil.</p><p>DPMPTSP sendiri pada Ketapang Expo 2017 ini melakukan terobosan dengan memberikan pelayanan perizinan secara online,  menampilkan display simulasi perhitungan retribusi, rekam jejak perizinan, informasi dan pengaduan yang belum pernah dilakukan pada Kabupaten Expo tahun sebelumnya.</p><p>Selain hal tersebut diatas, DPMPTSP juga telah memiliki website dengan fitur-fitur yang telah disesuaikan dengan keadaan pelayanan perizinan sekarang. Salah satu keunggulan fitur website sekarang bahwa formulir permohonan bisa langsung didownload sehingga hal tersebut dapat mempermudah masyarakat dalam hal pengurusan perizinan.</p>', '2017-07-14 03:32:04', 0x6173736574732f6265726974612f346161633635653130373663323930333238646639633466393266633066306233353761366664663736343262663831356138383832326334343764396463342e6a7067, 'Pembukaan Ketapang Expo 2017'),
(24, 'HUJAN YANG MENGGUYUR, MASYARAKAT SEMAKIN RAMAI', '<p>Hari kedua pelaksanaan Ketapang Expo 2017, tanggal 12 Juli 2017. Meskipun stand-stand pameran sempat diguyur hujan, hal ini tidak menyurutkan niat dan antusias dari masyarakat yang tetap ramai mengunjungi pameran ketapang expo bahkan pada pukul 19.30 WIB setelah hujan reda masyarakat yang datang semakin membludak. Di stand DPMPTSP sendiri cukup ramai masyarakat yang datang berkunjung baik yang ingin melakukan pemantauan terhadap status proses pelayanan perizinan, maupun yang hanya sekedar mencari informasi atau melihat data-data tentang perizinan tanpa harus datang langsung ke Instansi DPMPTSP. Masyarakat yang datang tidak hanya dapat memperoleh informasi serta melakukan pengurusan perizinan tetapi juga dapat mengetahui informasi dan melakukan pengurusan PBB, BPHTB, pengurusan berkas Kependudukan dan Catatan Sipil dan mengetahui rekam jejak kegiatan Bupati dan Wakil Bupati Ketapang yang terpilih karena Stand DPMPTSP tergabung dengan Badan Pendapatan Daerah, Dinas Kependudukan dan Pencatatan Sipil dan Sekretariat Daerah, Ibarat kata pepatah “Sekali merengkuh dayung, dua tiga pulau terlampaui”.</p>', '2017-07-14 01:44:06', 0x6173736574732f6265726974612f346161633635653130373663323930333238646639633466393266633066306263306462613538303963363230663730393432383536616430396231343464302e6a7067, 'HUJAN YANG MENGGUYUR, MASYARAKAT SEMAKIN RAMAI'),
(25, 'Kunjungan Bupati Ketapang ke Stand DPMPTSP', '<p>Memasuki hari ketiga, Pameran Ketapang Expo 2017 semakin ramai dikunjungi oleh masyarakat. Parkiran kendaraan roda dua maupun roda empat memenuhi halaman Pendopo Bupati Ketapang hingga memanfaatkan halaman rumah warga untuk lahan parkir kendaraan roda dua yang tidak mendapatkan ruang parkir di halaman Pendopo Bupati.</p><p>Pada kesempatan kali ini Bupati Ketapang Martin Rantan, SH kembali melakukan kunjungan untuk meninjau seluruh stand pameran. Dalam kunjungan tersebut, Bupati Ketapang menyempatkan diri untuk meninjau Stand DPMPTSP, Dinas Kependudukan dan Pencatatan Sipil, Badan Pendapatan Daerah dan Sekretariat Daerah. Saat memasuki Stand DPMPTSP, Bupati Ketapang disambut oleh Kasi Pelayanan Perizinan dan Non Perizinan Bidang B DPMPTSP Ridhwan, SP beserta staf yang bertugas menjaga stand pameran pada saat itu. Bupati Ketapang memberikan pesan dan kesan bagi seluruh pegawai DPMPTSP untuk “teruslah berkarya untuk kemajuan daerah”. Dengan adanya pesan tersebut diharapkan dapat menjadi cambuk bagi seluruh pegawai DPMPTSP untuk meningkatkan kinerja dalam memberikan pelayanan bagi masyarakat. Kunjungan Bupati ini merupakan suatu kehormatan bagi Stand DPMPTSP, Dinas Kependudukan dan Pencatatan Sipil, Badan Pendapatan Daerah dan Sekretariat Daerah.</p>', '2017-07-14 12:10:45', 0x6173736574732f6265726974612f346161633635653130373663323930333238646639633466393266633066306234353962633835643632633765383366626235326630333365303661386637352e6a7067, 'Kunjungan Bupati Ketapang ke Stand DPMPTSP'),
(26, 'Kesan dan Pesan Masyarakat', '<p>Penyelenggaraan Ketapang Expo 2017 telah memasuki hari keempat (14/07/2017). Kunjungan masyarakat ke Stand DPMPTSP, Dinas Kependudukan dan Pencatatan Sipil, Badan Pendapatan Daerah dan Sekretariat Daerah semakin bertambah. Keinginan masyarakat untuk mengetahui pelayanan perizinan semakin terlihat dengan banyaknya pengunjung yang mencari informasi mengenai  persyaratan perizinan dan hal ini menuntut petugas yang menjaga stand agar mampu memberikan penjelasan sebaik mungkin bagi para pengunjung.</p><p>Kesan dan pesan yang disampaikan oleh pengunjung pun semakin beragam. Sebagian besar pengunjung pun merasa puas atas penjelasan yang diberikan oleh petugas, adapun salah satu kesan yang disampaikan oleh pengunjung yang kami kutip atas nama IRMA HARIYANI yaitu tentang “Informasi yang diberikan sangat jelas dan detail”. Pernyataan Irma ini merupakan korelasi antara penjelasan langsung yang telah diberikan oleh petugas penjaga stand serta kemajuan sistem informasi anjungan mengenai simulasi perhitungan retribusi perizinan pada anjungan DPMPTSP.<br></p>', '2017-07-15 13:09:32', 0x6173736574732f6265726974612f323061326231363430643566353365316331663838663032656465346261616637626665373062396463396266666563616331353866383262663534393561392e6a7067, 'Kesan dan Pesan Masyarakat'),
(27, 'Bupati Pimpin Atasi Genangan Air di Ketapang Expo', '<p>Memasuki hari kelima pelaksanaan Ketapang Expo 2017 tanggal 15 Juli 2017, Ketapang kembali diguyur hujan yang cukup deras. Hujan yang berlangsung dari sore hingga malam hari telah mengakibatkan beberapa titik di tempat pameran digenangi oleh air. Begitu pula stand-stand pameran yang tidak luput dari hujan, tak terkecuali Stand DPMPTSP. Namun berkat kesigapan petugas Pemadam Kebakaran dari Satuan Polisi Pamong Praja dan para penjaga stand, air yang masuk dapat diatasi sehingga tidak merusak properti yang ada di dalam stand. Bupati Ketapang Bapak Martin Rantan, SH pada kesempatan kali ini turun kelapangan untuk meninjau titik-titik genangan air dan memimpin langsung petugas Damkar untuk mengurangi genangan air, ini merupakan wujud kepedulian dari Kepala Daerah Kabupaten Ketapang yang patut dijadikan contoh, khususnya dalam menyukseskan gawai daerah pergelaran pameran expo.</p><p>Kuantitas pengunjung yang datang&nbsp; pada mulanya terjadi penurunan jumlah yang sangat drastis, hal ini dikarenakan hujan yang tak kunjung berhenti. Memasuki pukul 19.30 WIB intensitas hujan mulai menurun dan keadaan di lokasi pameran berangsur-angsur kembali kondusif yang dibarengi dengan peningkatan intensitas hilir mudik dari para pengunjung.</p>', '2017-07-16 13:10:58', 0x6173736574732f6265726974612f363933366535306362636263646431653565666636616533393431363939633730373962346530663234323865343132313432363537666534643363626331342e6a7067, 'Bupati Pimpin Atasi Genangan Air di Ketapang Expo'),
(28, 'Penutupan Ketapang Expo 2017', '<p>Pameran Ketapang Expo 2017 yang dilaksanakan di halaman Pendopo Bupati Ketapang, tanggal 11 – 18 Juli 2017 usai sudah. Acara ditutup oleh Bupati Ketapang Bapak Martin Rantan, SH, pada hari Selasa (18/07/2017) malam. Pameran Ketapang Expo yang berlangsung selama delapan hari tersebut sukses menarik minat masyarakat ketapang yang terlihat dari banyaknya intensitas pengunjung yang datang dari hari pertama hingga penutupan acara tersebut. Dalam acara puncak Ketapang Expo kali ini selain menampilkan lagu dari para artis lokal Kabupaten Ketapang juga menampilkan pertunjukkan seni tradisional “bubu” yang mempunyai daya tarik tersendiri bagi masyarakat.</p><p>Setelah pertunjukkan acara hiburan selesai tibalah saatnya pengumuman pemenang dari berbagai kategori lomba, mulai dari perlombaan tarian japin tradisional dan tarian japin kreasi, lomba pembuatan corak/ motif batik kreasi &nbsp;serta kategori perlombaan stand untuk pedagang kaki lima (PKL), swasta, maupun Organisasi Perangkat Daerah. &nbsp;Untuk Stand DPMPTSP sendiri yang tergabung bersama dengan Dinas Kependudukan dan Pencatatan Sipil, Badan Pendapatan Daerah dan Sekretariat Daerah berhasil menyabet juara pertama Kategori Stand Organisasi Perangkat Daerah Terbaik dengan hadiah yang diperoleh yaitu Piala dan sejumlah uang tunai. Untuk penyerahan hadiah dan piala diberikan secara langsung oleh Bupati Ketapang beserta istri kepada perwakilan stand yang diwakili oleh Kepala Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang Suryanto Ar, SH.<br></p><p>Acara puncak Ketapang Expo ini ditutup dengan sambutan dari Bupati Ketapang Bapak Martin Rantan, SH. Dimana pada kesempatan ini beliau berjanji kepada seluruh masyarakat Kabupaten Ketapang untuk pelaksanaan Expo selanjutnya tidak akan terjadi lagi banjir di halaman komplek stand-stand pameran yang mengakibatkan sedikit ketidaknyamanan bagi para pengunjung dan pedagang kaki lima (PKL).<br></p><p>Selain menyampaikan hal tersebut diatas, beliau juga menitikberatkan kepada seluruh peserta untuk dapat menampilkan produk-produk unggulan daerah Kabupaten Ketapang baik berupa produk makanan khas Ketapang maupun produk kerajinan dan kesenian. Tidak luput perusahaan-perusahaan yang melakukan investasi di Kabupaten Ketapang baik Perusahaan yang bergerak di bidang tambang, perusahaan yang bergerak di bidang Perkebunan kelapa sawit, perusahaan yang bergerak di bidang pemanfaatan hasil hutan kayu serta perusahaan yang bergerak di bidang hutan tanam industri juga mendapatkan perhatian dari Bupati Ketapang untuk dapat menampilkan mekanisme atau alur proses kegiatan pengolahan, output yang dihasilkan serta maket dari perusahaan itu sendiri sehingga masyarakat menjadi lebih mengerti. (Pungkas Bapak Bupati)<br></p>', '2017-07-19 08:35:43', 0x6173736574732f6265726974612f643739333363326665303139333565373433653939623063366636316236303661633338313161366336626231383061613764623365393466646162343263632e6a7067, 'Penutupan Ketapang Expo 2017'),
(30, 'LAYANAN IZIN GANGGUAN DI KABUPATEN KETAPANG DIHENTIKAN', '<p>Berdasarkan Surat Edaran Bupati Ketapang Nomor 045.2/1502/Hk-A tanggal 4 Agustus 2017, Pemerintah Kabupaten Ketapang menghentikan pungutan retribusi Izin Gangguan dan penerbitan izin gangguan. Kebijakan ini merupakan tindak lanjut dari Peraturan Menteri Dalam Negeri Nomor 19 &nbsp;Tahun 2017&nbsp; tentang Pencabutan Peraturan Menteri Dalam Negeri Nomor 27 Tahun 2009 tentang Pedoman Penetapan Izin Gangguan di daerah. Atas dasar surat edaran &nbsp;tersebut Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu selaku unit pelayanan Izin gangguan diinstruksikan untuk tidak melakukan pungutan retribusi Izin Gangguan dan tidak menerbitkan Izin Gangguan lagi.</p>Kebijakan ini berkaitan dengan harmonisasi peraturan yang selama ini menjadi hambatan dalam proses perizinan baik usaha menengah kecil maupun besar serta menciptakan pertumbuhan iklim investasi di daerah.<br>', '2017-09-07 01:35:03', 0x6173736574732f6265726974612f633739313630323534393362663664316235333862356665303261326330363731643665613331363337353031396538303266356435666534386566396330372e6a7067, 'LAYANAN IZIN GANGGUAN DI KABUPATEN KETAPANG DIHENTIKAN'),
(31, 'BUPATI KETAPANG DELEGASIKAN WEWENANG PERIZINAN DAN NON PERIZINAN KE DPMPTSP KETAPANG', '<p>Pemerintah Kabupaten Ketapang siap untuk mengimplementasikan Peraturan Bupati Ketapang Nomor 23 Tahun 2017 tentang Pendelegasian Wewenang Penandatanganan Penerbitan Perizinan dan Non Perizinan Kepada Kepala Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu Kabupaten Ketapang yang disahkan pada tanggal 11 Agustus 2017. Perbup ini dibuat sebagai bentuk pelaksanaan terhadap Undang-Undang Nomor 23 Tahun 2014 tentang Pemerintahan Daerah dan Peraturan Presiden Nomor 97 Tahun 2014 tentang Penyelenggaraan Pelayanan Perizinan Terpadu Satu Pintu. Di dalam Perbup ini terdapat &nbsp;17 bidang dan 112 jenis perizinan dan non perizinan yang didelegasikan ke DPMPTSP Kabupaten Ketapang.</p><p>Daftar bidang dan jenis perizinan dan non perizinan yang didelegasikan antara lain:</p><ol><li>Bidang Perdagangan : SIUP, IUTM, Izin Pengelolaan Pasar Rakyat, Izin Usaha Pusat Perbelanjaan, Izin Usaha Pasar Tradisional, Izin Usaha Perdagangan Minuman Beralkohol Golongan B dan C untuk pengecer dan penjual langsung minum di tempat, TDP, TDG, SKPB, Rekomendasi Penerbitan Pengakuan Pedagang Kayu antar pulau terdaftar (PKAPT) dan pelaporan rekapitulasi perdagangan kayu antar pulau.</li><li>Bidang Perindustrian : Izin Usaha Industri Kecil dan Menengah, Izin Perluasan Usaha Industri (IPUI) Kecil dan Menengah, Izin Usaha Kawasan Industri dan Izin Perluasan Kawasan Industri yang lokasinya di daerah, Izin Usaha Industri, Izin Usaha Kawasan Industri, Tanda Daftar Industri.</li><li>Bidang Pariwisata : Tanda Daftar Usaha Pariwisata.</li><li>Bidang Pertanian : Izin Usaha Pertanian.</li><li>Bidang Perkebunan : Surat Persetujuan Penyaluran Benih Kelapa Sawit, Izin Usaha Perkebunan, Izin Perluasan Usaha Perkebunan, Penilaian Kelas Perkebunan.</li><li>Bidang Perikanan : Izin Usaha Perikanan, Tanda Pencatatan Usaha Pembudidayaan Ikan.</li><li>Bidang Peternakan : Izin Praktek Dokter Hewan, Izin Budidaya Peternakan, Rumah Sakit Hewan, Pasar Hewan dan Rumah Potong Hewan, Izin Sementara pemanfaatan Ruko/Bangunan Budidaya Walet, Izin Usaha Perbenihan, Izin Usaha Pengecer (Toko, Retail, Sub Distributor) Obat Hewan.</li><li>Bidang Perhubungan : Izin Penyelenggara Angkutan Orang Dalam Trayek Perdesaan dan Perkotaan, Izin Penyelenggaraan Taksi dan Angkutan Kawasan Tertentu, Izin Usaha Penyelenggara Angkutan Sungai dan Danau, Izin Trayek Penyelenggaraan Angkutan Sungai dan Danau, Izin Usaha Jasa Perawatan dan Perbaikan Kapal, Izin Pembangunan dan Pengoperasian Pelabuhan Sungai dan Danau, Izin Usaha Badan Pelabuhan Pengumpul Lokal, Izin&nbsp; Pengembangan Pelabuhan Untuk Pelabuhan Penumpang Lokal, Izin Pengoperasian Pelabuhan Selama 24 Jam Untuk Pelabuhan Penumpang Lokal, Izin Penyelenggaraan dan Pembangunan Fasilitas Parkir, Izin Pengelolaan Terminal Untuk Kepentingan Sendiri (TUKS) di Dalam Daerah Lingkungan Kerja (DLKR)/Daerah Lingkungan Kepentingan (DLKP) Pelabuhan Penumpang Lokal, Izin Reklamasi di Wilayah Perairan Pelabuhan Penumpang Lokal, Pemberian Rekomendasi Penetapan Lokasi Pelabuhan Khusus/Terminal untuk Kepentingan Sendiri, Rekomendasi Persetujuan Hasil Analisis Dampak Lalu Lintas untuk Jalan Kabupaten.</li><li>Bidang Pekerjaan Umum dan Tata Ruang : Surat Izin Usaha Jasa Konstruksi Nasional, Izin Mendirikan Bangunan, Izin Penyelenggaraan Reklame, Izin Lokasi, Izin Penggunaan Sumber Daya Air, Pelayanan Pengajuan Permohonan Keringanan Retribusi, Pemberian Sertifikat Laik Fungsi Bangunan Gedung.</li><li>&nbsp;Bidang Lingkungan Hidup : Izin Lingkungan, Izin Land Aplication, Izin Tempat Penyimpanan Sementara Limbah B3, Izin Tempat Pengumpulan Limbah B3, Pemberian Izin Pendaur Ulangan Sampah / Pengolahan Sampah, Pengangkutan Sampah dan Pemrosesan Akhir Sampah Yang Diselenggarakan oleh Swasta, Rekomendasi UKL-UPL, Surat Keputusan Kelayakan Lingkungan</li><li>Bidang Perumahan : Izin Pembangunan dan Pengembangan Perumahan.</li><li>Bidang Kawasan Permukiman : Penerbitan Izin Pembangunan dan Pengembangan Kawasan Pemukiman.</li><li>Bidang Komunikasi dan Informatika : Rekomendasi warnet/game online, Rekomendasi Penyelenggaraan jaringan Telekomunikasi Menara Tower, Rekomendasi Penyelenggaraan Penyiaran Swasta, Rekomendasi Izin Stasiun Radio/TV dan Frekuensi Radio/HT.</li><li>Bidang Penanaman Modal : Izin Prinsip Penanaman Modal, Izin Prinsip Perluasan Penanaman Modal, Izin Prinsip Perubahan Penanaman Modal, Izin Prinsip Penggabungan/Merger Perusahaan, Izin Usaha Penanaman Modal, Izin Usaha Perluasan Penanaman Modal, Izin Usaha Perubahan Penanaman Modal, Izin Usaha Penggabungan/Merger Penanaman Modal, Izin Pembukaan Kantor Cabang, Pelayanan Penanganan Pengaduan Perizinan, Pelayanan Konsultasi, Informasi dan Fasilitasi Permasalahan Terkait Perizinan.</li><li>Bidang Kesehatan : Izin Mendirikan Klinik, Izin Operasional Klinik, Izin Mendirikan Rumah Sakit Umum, Izin Operasional Rumah Sakit Umum, Izin Mendirikan Rumah Sakit Khusus, Izin Operasional Rumah Sakit Khusus, Izin Mendirikan Puskesmas, Izin Operasional Puskesmas, Izin Apotik, Izin Mendirikan Laboratorium Klinik, Izin Operasional Laboratorium Klinik, Izin Optikal, Izin Toko Obat, Izin Unit Tranfusi Darah, Izin Pelayanan Kesehatan Spa, Surat Izin Kerja Perawat, Surat Izin Praktek Perawat, Surat Izin Kerja Bidan, Surat Izin Praktek Bidan, Surat Izin Praktek Dokter/Dokter Gigi/Dokter Gigi Spesialis/Dokter Spesialis, Izin Kerja Apoteker, Izin Kerja Asisten Apoteker, Izin Kerja Refraksionis Optisien, Izin Kerja Fisioterapis, Izin Kerja Ahli Teknologi Laboratorium Medik, Izin Kerja Gizi, Izin Kerja Perawat Gigi, Izin Kerja Tenaga Sanitarium Kesehatan Lingkungan, Izin Kerja Rekam Medik Informasi Kesehatan, Izin Kerja Rekam Medik, Izin Kerja Akupuntur, Izin Kerja Pengobatan Komplementer Alternatif, Izin Operasional Tukang Gigi.</li><li>Bidang Sosial : Izin Pengumpulan Sumbangan Dalam Daerah Kabupaten, Izin Penarikan Undian, Rekomendasi BPJS.</li><li>Bidang Tenaga Kerja : Izin Perpanjangan IMTA yang lokasi kerja dalam 1 (satu) daerah Kabupaten.&nbsp;</li></ol><p>Dengan diterbitkannya Peraturan Bupati ini bertujuan memberikan perlindungan dan kepastian hukum kepada masyarakat, memperpendek proses pelayanan, mewujudkan proses pelayanan yang cepat, mudah, murah, transparan, pasti dan terjangkau serta mendekatkan dan memberikan pelayanan yang lebih luas kepada masyarat.</p>', '2017-09-07 01:43:16', 0x6173736574732f6265726974612f633739313630323534393362663664316235333862356665303261326330363734393063333438333239613631383732626166336139326334376133376632332e6a7067, 'BUPATI KETAPANG DELEGASIKAN WEWENANG PERIZINAN DAN NON PERIZINAN KE DPMPTSP KETAPANG'),
(33, 'Pelayanan Perizinan Berusaha melalui OSS', '<p>Terbitnya Peraturan Pemerintah Nomor 24 Tahun 2018 tentang Pelayanan Perizinan Berusaha Terintegrasi Secara Elektronik, secara automatis pengajuan perizinan berusaha yang dulunya melalui DPMPTSP sekarang berdasarkan peraturan tersebut harus melalui OSS (Online Single Submission).&nbsp;OSS adalah media penyelenggaraan perizinan berusaha online melalui web dan atau applikasi smartphone. Dalam PP 24 tersebur juga telah terjadi penyederhanaan jenis perizinan yang serta merta menjadi acuan lembaga kementerian dan non kementerian serta daerah dalam penerbitan perizinan.</p>\r\n\r\n<p>OSS dapat diakses melalui www.oss.go.id</p>\r\n\r\n<p>Pelaku Usaha wajib memiliki email untuk mendapatkan User ID dan Password OSS. Pendaftaran dilakukan pada menu &quot;dafar&quot; dihalaman website OSS, kemudian pelaku usaha akan mendapatkan user id dan passwor dan melanjutkan mengajukan perizinan berusahanya melalui menu &quot;login&quot;. Perizinan berusaha yang akan didapatkan melalui OSS antara lain : NIB (Nomor Induk Berusaha), Izin Usaha dan Izin Komersial/Operasional.</p>\r\n\r\n<p>Pengajuan izin menggunakan OSS tersebut dapat dilakukan pelaku usaha dimanapun berada atau dengan datang ke DPMPTSP untuk didampingi oleh petugas yang telah ditunjuk. Demikian sekilas info singkat terkait pengajuan perizinan berusahaan berdasarkan PP 24 tahun 2018. semoga bermanfaat, mempermudah kegiatan berusaha serta meningkatkan keinginan berinvestasi baik Penanaman Modal Dalam Negeri, maupun Penanaman Modal Asing.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2019-09-04 07:45:51', 0x6173736574732f6265726974615c633431616232666137373866653466636636616137333730313662666463383236663266656438653632366537643132333865386431356133313034613432622e6a7067, 'Pelayanan Perizinan Berusaha melalui OSS'),
(34, 'Resolusi DPMPTSP 2019', '<p>Dengan terbitnya PP 24 tahun 2018 dimana seluruh perizinan berusaha wajib melaksanakan proses perizinan melalui OSS, diikuti peraturan K/L teknis tentang Norma Standar Prosedur Kreteria perizinan maka menyesuaikan dengan aturan tersebut, simpelpadu yang selama ini digunakan sebagai media proses pelayanan perizinan terhitung tanggal 2 januari 2019 dihentikan.<br />\r\nAdapun proses pelayanan perizinan di Kabupaten Ketapanag saat ini secara bertahap berpindah melalui OSS dan Sicantik.</p>\r\n\r\n<p>Demi ketersediaan data perizinan berusaha yang lengkap dan akurat, baik yang bersifat pemenuhan komitmen maupun penerbitan izin maka ditahun 2019 DPMPTSP sedang menyiapkan sistem baru. Pelayanan umum seperti sms gateway dan pengaduan yang ada pada simpelpadu akan tetap melekat disistem yang sedang dibangun tersebut.</p>\r\n\r\n<p>Salam CERMAT</p>\r\n', '2019-09-04 07:45:38', 0x6173736574732f6265726974615c633431616232666137373866653466636636616137333730313662666463383263336463663431643332306163363564373932323332363632336433323236332e6a7067, 'Resolusi DPMPTSP 2019'),
(35, 'Expose dan Rencana Investasi PT. WestKal Integrated Parks di Kabupaten Ketapang 1 Oktober 2019', '', '2019-10-16 02:22:07', 0x6173736574732f6265726974612f336665366262373233333832656437633262626537623762663364656232333565623132396263636235313335393431396562346563346662653332663436332e6a7067, 'dpmptsp'),
(36, 'Sosialisasi Perizinan Secara Elektronik', '<p>Salah satu faktor yang mempengaruhi peningkatan investasi disuatu daerah adalah pelayanan perizinan.<br />\r\nDengan telah terbitnya Peraturan Pemerintah (PP) tahun 2018 tentang Pelayanan Perizinan Berusaha Terintegrasi Secara Elektronik (melalui OSS), maka secara bertahap perizinan akan menuju kearah perizinan digital yang harusnya mempermudah pelaku usaha untuk mendapatkn izin berusaha. Sosialisasi terkait PP tersebut telah dilakukan dibeberapa kecamatan diwilayah Kab. Ketapang.<br />\r\nSemoga dengan telah diterapkannya PP 24 tahun 2018 ini, dapat mengubah mindset pelaku usaha bahwa perizinan itu mudah serta mendongkrak keinginan pelaku usaha untuk berinvestasi</p>\r\n', '2019-10-16 02:30:42', 0x6173736574732f6265726974612f336665366262373233333832656437633262626537623762663364656232333563616434343531376233353935306361383563666665343434353866663235612e6a7067, 'Oss'),
(37, 'Potensi Wisata Alam ', '<p>Karang Dangin adalah sebuah desa yang berada di Kecamatan Jelai Hulu Kab. Ketapang. Desa tersebut memiliki potensi alam yang luar biasa. Salah satunya adalah Silingan Begendum yaitu objek alam yang menarik untuk bersantai bersama keluarga. Air terjun dan aliran air diantara bebatuan dari mata air pegunungan membuat lelah perjalanan anda akan terobati.<br />\r\nSemoga kedepannya tempat ini dapat dikelola dengan baik oleh pemerintah baik melalui BUMDes atau melalui instansi terkait maupun oleh investor untuk meningkatkan sarana dan prasarana termasuk akses menuju lokasi sehingga Silingan Begendum Karang Dangin dapat menjadi salah satu objek wisata andalan Kabupaten Ketapang.<br />\r\n(Foto diambil pada saat kemarau)</p>\r\n', '2019-10-21 07:23:27', 0x6173736574732f6265726974612f616336613233636336633534663063363562343438373765653064303962353762636130636365336361353830653536643666626433613734653035653931392e6a7067, 'silingan begendum'),
(38, 'LOMBA FOTO POTENSI DAERAH', '<p>Bagi teman-teman yang suka ceprat cepret, nih salurkan hobinya untuk lomba foto potensi daerah dalam rangka promosi potensi daerah Kabupaten Ketapang.</p>\r\n\r\n<p>Lomba Foto ini dilaksanakan dari tanggal 28 Okt s/d 25 Nov 2019 dengan mengambil tema : &quot;Potensi daerah Kab. Ketapang&quot;. Ada pun sektor potensi daerah sbb:</p>\r\n\r\n<p>- Perkebunan</p>\r\n\r\n<p>- Pertanian</p>\r\n\r\n<p>- Kelautan</p>\r\n\r\n<p>- Budidaya air tawar</p>\r\n\r\n<p>- Pertambangan</p>\r\n\r\n<p>- Pariwisata</p>\r\n\r\n<p>- Industri</p>\r\n\r\n<p>- Usaha kecil dan Mikro</p>\r\n\r\n<p>Untuk Informasi lebih lanjut kunjungi IG @ketapang_invesment</p>\r\n\r\n<p>Ditunggu yaaa.....</p>\r\n', '2019-10-25 01:46:13', 0x6173736574732f6265726974612f353734313936393839343238663361353139326433333132393161306262643736663964303662656338316430656362353165343739663138316531386435622e6a7067, '@ketapang_invesment'),
(39, 'Diskusi bersama kepala seksi promosi pemkot Bandung', '<p>Kepala Bidang pengembangan penanaman Modal dan Kepala seksi promosi penanaman modal melakukan koordinasi ke Pemkot Bandung terkait strategi menggali, mengangkat dan mempromosikan potensi daerah yang ada sebagai potensi dan peluang investasi / penanaman modal (28/10/19).</p>\r\n', '2019-10-31 01:43:42', 0x6173736574732f6265726974612f366130643730343337396365396366643739373935636165353565306537636163323935363831373963613466366536323535326631346436396238313062322e6a7067, '@ketapang_investment'),
(40, 'Peninjauan PT. Weskal', '<p>Kegiatan lapangan, tindaklanjut rencana investasi PT. WestKal. Peninjauan dan pengambilan sampel tanah untuk lahan pertanian (30/10/19).</p>\r\n', '2019-10-31 01:48:23', 0x6173736574732f6265726974612f366130643730343337396365396366643739373935636165353565306537636163663964393962646164643261343533636665343437623933323331646439642e6a7067, '@ketapang_investment'),
(41, 'Peluncuran Logo, Video dan Majalah Potensi Daerah', '<p>Promosi Potensi Daerah Melalui Logo , Video, Dan Majalah</p>\r\n\r\n<p>Martin Rantan , Jadikan Peluang Investasi</p>\r\n\r\n<p>Ketapang 19 Des 2019....Promosi Potensi Daerah Kabupaten Ketapang melalui Logo, Video dan majalah merupakan peluang investasi . Sehingga diharapkan menjadi daya tarik para Investor dalam berinvestasi.</p>\r\n\r\n<p>Hal tersebut dikatakan Bupati Ketapang Martin Rantan SH M S.Sos pada Launching logo video dan majalah promosi potensi daerah Ketapang, Kamis 19/12/2019</p>\r\n\r\n<p>Dikatakan Martin Rantan Bupati Ketapang ,di Hotel Onix hari itu, Melalui promosi potensi daerah ini, hendaknya dapat menghadirkan karakteristik dan memperkuat identitas Pemkab Ketapang. Juga hendaknya mampu memberikan semangat untuk saling bahu membahu dan membantu promosi potensi wisata demi kepentingan bersama . Jaga kondusif daerah kabupaten Ketapang ini agar investasi yang masuk benar benar berinvestasi dengan baik untuk Ketapang maju menuju kesejhateraannya</p>\r\n\r\n<p>Acara yang digelar Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu hari itu diwarnai dengan pemberian hadiah pemenang lomba poto promosi daerah Kabupaten Ketapang dan penyerahan majalah yang di launcing.<br />\r\nHadir juga Ketua DPRD M Febriadi juga sejumlah pimpinan Forkompimda, para pimpinan OPD, dan sejumlah undangan lainnya.</p>\r\n', '2019-12-27 07:31:03', 0x6173736574732f6265726974612f626638666162386535313439613866316363343465663366663764323163623033373637636435643736323435316439626434653739353536613664393766662e6a7067, '@ketapanginvestment'),
(42, 'Cap Go Meh 2020', '<p>Martin Rantan : Budaya Cap Go Meh Jadian Perekat Semua Etnis</p>\r\n\r\n<p>Ketapang , 8/2/2020.. Martin Rantan SH M Sos Bupati Ketapang berharap, Melalui Perayaan budaya Imlek dan Cap Go Meh hendaknya dijadikan pemersatu dan perekat kerukunan semua etnis .<br />\r\nHarapan tersebut dikatakannya ketika pelepasan pawai budaya Cap Go Meh di Klenteng Tua Pek Kong Ketapang, 8/2/2020<br />\r\nSebagai perekat etnis , Kata Bupati Martin, kegiatan budaya Imlek dan Cap Go Meh ternyata membuahkan hasil positif .. Seperti saling berkunjung, Untuk itu mari kita syukuri . Dengan saling berkunjung maka akan.mendatangkan rejeki banyak dan melimpah dimasa yang akan datang. TerNg Martin<br />\r\nDitegaskannya, ,Perayaan Imlek dan cap go meh bukan upacara keagamaan tapi kegiatan kebudayaan. Pemkab Ketapang menyambut baik dan sangat mendukung kegiatan budaya tionghoa ini.<br />\r\nOleh karenya Trims kepada warga Tionghoa yg telah melestarikan adat budaya leluhurnya ini . Termasuklah melibatkan partisipasi berbagai suku dalam malam pawai budaya Cap Go Meh Seperti mengikut sertakan kendaraan hias suku suku yang ada di Kabupaten Ketspang. . . Hal ini menu jukan adanya<br />\r\nKeberagaman suku masyarakat ketapang bersatu padu membaur dalam membangun kabupaten Ketapang khususnya dibidang kebudayaan. Sehingga bisa menarik kunjungan wisata budaya kita Kata Bupati.</p>\r\n\r\n<p>Kedepan ujarnya Peringatan Cap Go meh supaya lebih ditingkatkan lagi dan tentunya perlu dukungan banyak.pihak khususnya etnis etnis yang ada di Kabupaten Ketapang. Bagi Pemerintah tidak masalah dan sangat mendukung. . Kenyataan dalam.pawai budaya cap Go Meh ada ikut berbagai etnis. Hal ini menunjukan adanya kebersamaan membangun budaya.<br />\r\nMalam pawai cap go meh dilepas oleh Ketua TP PKK Kab Ketapang Ny Elisabet Betty Martin Rantan bersama Ny Suwarni Suprapto<br />\r\nHadir dlm.kesempatan tersebut Wakil Bupati Ketapang Drs H Suprapto dan Sekda H Farhan SE M Si beserta istri , Para Anggota Forkompinda OPD terkait dan sejumlah undangan lainnya termasuk pimpinan dan pengurus organisasi etnis.</p>\r\n\r\n<p>Kemeriahan malam Cap Go Meh dimeriahkan dengan keikutsertaan berbagai etnis dengan ciri khas kendaraan hiasnya. atraksi naga dan barongsai serta Tatung. Sehingga membuat warga kota Ketapang tumpah ruah memadati kiri kanan jalan yang dilalui peserta pawai. Kemeriahannya juga tampak didominasi lampu merah dari lampu lampion menambah keindahan .</p>\r\n\r\n<p>Sumber: Pemkab Ketapang (omn)</p>\r\n', '2020-02-11 03:06:35', 0x6173736574732f6265726974612f613765316661396538363832663133316561646336656464336266643133656562313739616366336539363235346638366261613830326338343235376631642e6a7067, '2020'),
(43, 'Rapat Konsolidasi Data Realisasi Investasi Tahun 2019 Direktorat Wil II', '<p>&nbsp;&nbsp;&nbsp; Yogyakarta, Direktorat Wilayah II BKPM mengadakan Rapat Kondolidasi Data Realisasi Investasi Tahun 2019 bertempat di The Phoenix Hotel Yogyakarta 13-02-2020. Dalam kesempatan ini disampaikan Langsung oleh Direktur Wilayah II Ibu Rita. Perkembang realisasi penanaman modal triwulan IV 2019 Rp 208,3T naik 1,3% dari&nbsp; triwulan III 2019 (Rp 205,7T). Realisasi Investasi pada Januari-Desember 2019 Rp 809,6 T, meningkat 12,2% dari tahun sebelumnya yaitu Rp. 721,3 T, dan Melebihi Target dari RPJMN.</p>\r\n\r\n<p>Realisasi Triwulan IV 2019 berdasarkan Lokasi, PMDN Kalimantan Barat menduduki peringkat 15 dengan nilai investasi sebesar 1.556,69(dalam Miliar) 513 proyek, sedangkan PMA Peringkat 14 dengan investasi 127,92 (dalam US$ Juta) 250 proyek. Maka demikian dengan investasi TW IV Kalimantan Barat Untuk Periode Januari-Desember 2019 PMDN peringkat 13 Investasi Rp 7.699,1 M dan PMA peringkat 14 Investasi US$ 532,3 Juta.</p>\r\n\r\n<p>Realisasi Januari-Desember 2019 untuk kabupaten/kota dalam hal ini Kabupaten Ketapang untuk PMA realiasai investasi sebesar 303,521 (US$.Ribu) jumlah proyek 193 57.02%, dan PMDN realisasi Investasi sebesar 771,943 (Rp.Juta)jumlah proyek 77 10.03%.</p>\r\n\r\n<p>Untuk target Investasi diwilayah II tahun 2020 sebesar 886T dan Kalimantan Barat mendapat target sebesar 29.0T</p>\r\n', '2020-02-20 07:00:36', 0x6173736574732f6265726974612f363065373031396539376139363138373339613030343664356137373539326261363138326231303038373434376265363537363263373263383037383437362e6a7067, '@bkpm'),
(44, 'RAKORNAS INVESTASI 2020 INVESTASI UNTUK INDONESIA MAJU', '<p>Presiden <a href=\"https://www.instagram.com/jokowi/\">@jokowi</a> hadir membuka secara resmi acara Rapat Koordinasi Nasional (RAKORNAS) Investasi 2020 yg diselenggarakan oleh BKPM di Ritz Carlton - Pacific Place (20/2). Presiden <a href=\"https://www.instagram.com/jokowi/\">@jokowi</a> menegaskan dunia usaha dan sektor swasta memiliki peran yg sangat penting dalam pertumbuhan ekonomi. Saat ini APBN hnya berpengaruh 16% dalam pertumbuhan ekonomi, sedangkan jika digabung dengan APBD maka hanya 23% pengaruhnya. 77% sisanya merupakan peran dunia usaha dan sektor swasta.<br />\r\nBKPM diminta untuk fokus pada adanya investasi mangkrak sebesar Rp 708 T dan minat investasi sebesar Rp 1.600 T. Selain itu juga komitmen dalam melayani investor, termasuk pengusaha skala kecil maupun menengah.<br />\r\n<br />\r\nKepala BKPM <a href=\"https://www.instagram.com/bahlillahadalia/\">@bahlillahadalia</a> dlm laporannya menyampaikan optimismenya bersama dengan pemerintah daerah untuk mencapai target realisasi investasi 2020 sebesar Rp 886 T.<br />\r\n<br />\r\nDitekankan bahwa saat ini BKPM akan mengawinkan pengusaha nasional dan asing yang masuk dengan pengusaha nasional di daerah.<br />\r\n<br />\r\nRakornas 2020 ini dihadiri oleh 2000 peserta terdiri dari Pejabat Pemerintah Pusat, Gubernur, Bupati, Walikota, Sekretari Daerah, serta Kepala Dinas Penanaman Modal dan PTSP (DPMPTSP) Provinsi serta Kabupaten/Kota termasuk Kabupaten Ketapang yang dihadiri oleh Kepala DPMPTSP dan Kepala Bidang Pengembangan Penanaman Modal.</p>\r\n', '2020-02-25 02:31:41', 0x6173736574732f6265726974612f323331353734353861323166363535656338333139373732636437363936356630643466623335646630643063643639393231373530373031333938333438622e6a7067, '#ketapanginvesmet #bkpm'),
(45, 'HARI JADI KOTE KETAPANG 602', '<p>Suasana Pelayanan Front Office di DPMPTSP, memeriahkan hari jadi Kote Ketapang ke 602 | 11 Maret 2020.</p>\r\n', '2020-03-11 08:55:27', 0x6173736574732f6265726974612f303333323333343064373466343761363066343036343333346332393662663262373062616437363639643762626431383032333432343834646361643933302e6a7067, 'ketapang_invesment');
INSERT INTO `berita` (`id_berita`, `judul`, `deskripsi`, `tanggal`, `gambar`, `tags`) VALUES
(46, 'Peninjauan Lapangan PT. KBS dan PT. BAP oleh TIM BKPM RI', '<p>Bertepatan dgn HUT Ketapang ke 602, tanggal 11 Maret 2020, Direktur Wilayah II Badan Koordinasi Penanaman Modal Republik Indonesia (BKPM RI) dan tim bersama DPMPTSP Prov. Kalbar didampingi Kepala DPMPTSP Kabupaten Ketapang, meninjau lokasi kegiatan usaha PT. KBS dan PT. BAP yang berada di Kec. Matan Hilir Selatan.</p>\r\n\r\n<p>Dalam kesempatan tersebut Direktur Wilayah II BKPM secara langsung meninjau progres kegiatan usaha dan berdiskusi ringat terkait dengan hambatan-hambatan yang terjadi dilapangan. BKPM beserta DPMPTSP akan bersama-sama mengawal investasi dan memfasilitasi jika pelaku usaha menghadapi hambatan dan kendala.</p>\r\n\r\n<p>Sementara Kepala DPMPTSP Kab. Ketapang berharap PT. KBS dan PT. BAP melakukan percepatan pembangunan dan segera beroperasi sehingga keberadaan perusahaan ini memberikan dampak positif kepada masyarakat sekitar, terutama pagi penciptaan lapangan kerja, dan DPMPTSP Ketapang siap membantu percepatan tersebut sepanjang sesuai kewenangan daerah sebagaimana arahan dan fokus Bupati Ketapang terkait dengan percepatan pengembangan investasi di Kabupaten Ketapang dalam rangka peningkatan perekonomian masyarakat.</p>\r\n\r\n<p>Disela kegiatan tersebut, Direktur Wilayan II BKPM RI menyempatkan diri untuk berkunjung ke kantor DPMPTSP Kabupaten Ketapang.</p>\r\n', '2020-03-12 02:20:05', 0x6173736574732f6265726974612f343163653266393931373136663163353139323139663061643764646433316138316165376564333364323564643961313132633563303631623033396539352e6a7067, '@ketapang_investment'),
(47, 'DALAM UPAYA PENCEGAHAN PENYEBARAN COVID-19', '<p>Diminta Kerjasama Seluruh Pelaku Usaha di Kabupaten Ketapang untuk melaksanakan hal-hal sebagai berikut :</p>\r\n\r\n<p>1. Menghentikan Sementara Masuknya Tenaga Kerja Asing (TKA) di Wilayah Kabupaten Ketapang.</p>\r\n\r\n<p>2. Menghentikan Sementara Kegiatan Usaha Hiburan Seperti PUB, Karaoke dan Usaha Hiburan lainnya.</p>\r\n\r\n<p>3. Kegiatan Usaha yang Menyajikan dan Menjual Makanan dan atau Minuman Hanya Diperkenankan Melayani Pesanan Bawa Pulang / Take Away atau Pesan Antar.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Instruksi Bupati Ketapang Nomor 0747 Tahun 2020 Tanggal 23 Maret 2020 dan Instruksi Bupati Nomor 360/0130/BPBD tanggal 1 April 2020</p>\r\n\r\n<p>TTD</p>\r\n\r\n<p>BUPATI KETAPANG</p>\r\n\r\n<p>MARTIN RANTAN, S.H., M.S.Sos</p>\r\n', '2020-04-06 05:24:18', 0x6173736574732f6265726974612f656632623131396534376435343233643330356430316261323564366531633264323831373036613331356236663863353835346163633732303539623264302e6a7067, '@ketapang_investment'),
(48, 'Pegawai Kantor DPMPTSP Ketapang Salurkan Bantuan Sembako ke Warga Terdampak Covid-19', '<p>Kepala DPM PTSP Ketapang, Syamsul Islami mengatakan kalau kegiatan sosial ini murni inisiatif dan panggilan hati dari para pegawai DPMPTSP Ketapang guna untuk ikut serta dalam upaya pemerintah dalam menanggulangi persoalan virus ini serta dampak yang terjadi akibat wabah Covid-19.</p>\r\n\r\n<p>&ldquo;Walaupun bantuan ini seadanya, setidaknya kami ikut berbuat untuk membantu masyarakat dalam masa pandemi ini. Serta berharap semoga wabah covid-19 segera berlalu,&rdquo; katanya, Senin (20/4/2020).<br />\r\nBantuan berupa paket sembako yang telah terkumpul tersebut, ia serahkan langsung kepada koordinator aksi peduli ini yaitu Kepala Bidang (Kabid) Pengembangan Penanaman Modal, Rio Marisa, untuk kemudian disalurkan langsung kepada masyarakat yang membutuhkan.</p>\r\n\r\n<p>&ldquo;Ini semua dari para pegawai yang merencanakan untuk bersama sama menggalang dana. Kemudian dalam pelaksanaannya dikoordinir oleh Kabid Pengembangan Penanaman. Semoga bermanfaat untuk mereka yang benar benar membutuhkan,&rdquo; ungkapnya.</p>\r\n\r\n<p>Sementara Itu, Koordinator aksi pendukung, Rio Marisa mengatakan kalau aksi ini merupakan wujud kepedulian terhadap pandemi Covid-19 yang masih terus mewabah diseluruh dunia. Sehingga mengakibatkan kegiatan rutinitas semua orang menjadi terbatas.</p>\r\n\r\n<p>&ldquo;Pandemi ini juga mengakibatkan dampak ekonomi yang mengkhawatirkan kepada seluruh usaha terutama dampak ekonomi kepada para karyawannya,&rdquo; ujarnya.</p>\r\n\r\n<p>Ia menyebut kalau dari hasil penggalangan internal yang dilakukan terkumpul sebanyak 42 paket sembako. Paket bantuan sembako tersebut akan langsung diserahkan kepada warga terdampak yang telah terdata sebelumnya oleh pihaknya.</p>\r\n\r\n<p>&ldquo;Semoga apa yang dilakukan oleh ASN di DPM PTSP Ketapang ini dapat bermanfaat bagi warga yang juga akan menyambut datangnya bulan suci ramadhan yang tidak berapa lama lagi ini,&rdquo; tandasnya. Sumber @<em><strong>(Adi LC)</strong></em></p>\r\n', '2020-04-21 02:35:49', 0x6173736574732f6265726974612f393438643061363865613635663633396237616363376562376664396430383662613037373332363033353437373463313933623034663661663931303139322e6a7067, '@ketapang_invesment'),
(49, 'Rapat Fasilitasi PT. KETAPANG BANGUN SARANA dan PT. BORNEO ALUMINDO PRIMA dalam Percepatan Investasi', '<p>Rapat Fasilitasi ini dilaksanakan secara Video Conference yang dipimpin oleh Direktur Wilayah II Badan Koordinasi Penanaman Modal ( @bkpm_id ).<br />\r\nRapat membahas terkait percepatan pelaksanaan investasi PT. KBS dan PT. BAP di Kawasan Industri Kabupaten Ketapang.<br />\r\n4 Juni 2020.<br />\r\n#bkpm<br />\r\n#dpmptsp<br />\r\n#dpmptspkalbar<br />\r\n#ketapang<br />\r\n#ketapanginvestment</p>\r\n', '2020-06-04 07:16:25', 0x6173736574732f6265726974612f663463303639376130643236623139313664653163303534393862363039613733386261353135373365376164336566356130626533376265343236303234362e6a7067, '@ketapang_investment'),
(50, 'Peningkatan Promosi Potensi Daerah', '<p><span dir=\"auto\">Dalam Pelaksanaan Kegiatan Peningkatan Promosi Potensi Daerah dan Pengembangan Investasi Dalam Tatanan New Normal di Kabupaten Ketapang, Kepala DPMPTSP Kabupaten Ketapang yang diwakili oleh Kepala Bidang Pengembangan Penanaman Modal Rio Marisa melakukan kunjungan kebeberapa hotel diantaranya @astonketapang @nevadaketapanghotel @grandzuriketapang @favehotelketapang </span></p>\r\n\r\n<p><span dir=\"auto\">@borneoemeraldhotel untuk meninjau kesiapan pelaksanaan pelayanan dengan protokol kesehatan serta melakukan diskusi singkat terkait dengan pengembangan investasi.</span></p>\r\n\r\n<p><span dir=\"auto\">Dalam kegiatan tersebut DPMPTSP juga menyampaikan media promosi dalam bentuk benner dan video potensi daerah agar dapat ditampilkan pada media informasi disetiap hotel yang dikunjungi.</span></p>\r\n\r\n<p><span dir=\"auto\">Masih dengan kegiatan yang sama yaitu promosi potensi daerah sebagai upaya peningkatan daya tarik investasi, DPMPTSP juga melakukan kunjungan ke Kantor Unit Penyelenggara Bandar Udara Rahadi Usman dan akan menjalin komunikasi dengan lebih lanjut dengan instansi lainnya.</span></p>\r\n\r\n<p><span dir=\"auto\"><a href=\"https://www.facebook.com/hashtag/ketapanginvestment?__eep__=6&amp;__cft__[0]=AZXylz5nI4uj0I2WP78mg4vd5w3NFmjyRo6uMzBApkY1FrIWOp4CKxAngyuROHCAqyhPHLi6dUFRl0FvY9ROcWaNVMbQgce_1wGoyQBkC2NW3TNYwuIVfgKjwAFoB5kotCI&amp;__tn__=*NK-R\">#ketapanginvestment</a> </span></p>\r\n\r\n<p><span dir=\"auto\"><a href=\"https://www.facebook.com/hashtag/dpmptsp?__eep__=6&amp;__cft__[0]=AZXylz5nI4uj0I2WP78mg4vd5w3NFmjyRo6uMzBApkY1FrIWOp4CKxAngyuROHCAqyhPHLi6dUFRl0FvY9ROcWaNVMbQgce_1wGoyQBkC2NW3TNYwuIVfgKjwAFoB5kotCI&amp;__tn__=*NK-R\">#dpmptsp</a></span></p>\r\n\r\n<p><span dir=\"auto\"><a href=\"https://www.facebook.com/hashtag/ketapang?__eep__=6&amp;__cft__[0]=AZXylz5nI4uj0I2WP78mg4vd5w3NFmjyRo6uMzBApkY1FrIWOp4CKxAngyuROHCAqyhPHLi6dUFRl0FvY9ROcWaNVMbQgce_1wGoyQBkC2NW3TNYwuIVfgKjwAFoB5kotCI&amp;__tn__=*NK-R\">#ketapang</a> </span></p>\r\n\r\n<p><span dir=\"auto\"><a href=\"https://www.facebook.com/hashtag/ketapangcreatingfuture?__eep__=6&amp;__cft__[0]=AZXylz5nI4uj0I2WP78mg4vd5w3NFmjyRo6uMzBApkY1FrIWOp4CKxAngyuROHCAqyhPHLi6dUFRl0FvY9ROcWaNVMbQgce_1wGoyQBkC2NW3TNYwuIVfgKjwAFoB5kotCI&amp;__tn__=*NK-R\">#ketapangcreatingfuture</a></span></p>\r\n', '2020-06-29 07:01:10', 0x6173736574732f6265726974612f656530353538666361323436353335363034613566623437383033646438303965643739386565633735383037646636653739623062653339316637323065342e6a7067, '@ketapang_invesment'),
(51, 'Selamat Purna Tugas Ibu Dra. Hj. Rusyatimah, M.M', '', '2020-07-01 01:55:08', 0x6173736574732f6265726974612f666263626261623234376539333463393262376166313061653535663961633263323730333830393238333739623131383131336230653063653161336632662e6a7067, '#dpmptsp'),
(52, 'Untuk Menjadi Perhatian', '', '2020-08-11 01:59:32', 0x6173736574732f6265726974612f366335353034653032323662636439326266313165663031643136646537373161306263363731633262626539373863383839616233376632633462373262312e6a7067, '#dpmptsp'),
(53, 'Kunjungan Kerja Bupati Ketapang', '<p>Bupati Kabupaten Ketapang melakukan kunjungan kerja ke beberapa kecamatan adapun kunjungan kerja tersebut Bupati didampingi oleh Wakil Bupati, Sekretaris Daerah, Assisten, Kepala OPD, Kepala Bagian Beserta Para Camat. kegiatan tersebut dilakukan pada tanggal 8-9 Agustus 2020.</p>\r\n\r\n<p>beberapa kegiatan yang dilakukan Bupati adalah Meresmikan pasar desa sungai melayu dan tumbang titi, pelantikan kades suka mulia sei melayu, peresmian gereja GPIB dan launching jaringan listrik pertama dusun batu pindah, dusun sinar terang dan dusun tiga pengancing, peresmian jembatan pesaguan 3 di desa nanga kelampai, pelepasan 6000 bibit ikan di desa jungkal serta deklarasi menjaga dan memelihara DAS sungai Pesaguan, dan terakhir Bupati Ketapang Meresmikan Pasar Desa Pesaguan Kanan.</p>\r\n\r\n<p>@admin</p>\r\n', '2020-08-11 02:32:12', 0x6173736574732f6265726974612f366335353034653032323662636439326266313165663031643136646537373131336162323932393135323838666132363336663236633836396636366539382e6a7067, '#dpmptsp'),
(54, 'Koordinasi Lintas Sektoral', '<p>Selasa, 11 Agustus 2020.<br />\r\nKasat Lantas Polres Ketapang AKP Aditya Octorio dan rombongan melakukan koordinasi ke DPMPTSP yang disambut langsung oleh Kepala DPMPTSP Syamsul Islami didampingi Kepala Bidang Pengembangan Penanaman Modal Rio Marisa.<br />\r\nKoordinasi tersebut membahas terkait Surat Mempan RB perihal peningkatan pelayanan publik melalui Mall Pelayanan Publik.<br />\r\n<br />\r\nGimana nih tanggapannya seandainya seluruh pelayanan publik di Ketapang berada disebuah gedung kantor (Mall Pelayanan Publik)?<br />\r\n<br />\r\nKetapang Creating Future<br />\r\n<a href=\"https://www.instagram.com/explore/tags/dpmptsp/\">#dpmptsp</a><br />\r\n<a href=\"https://www.instagram.com/explore/tags/ketapang/\">#ketapang</a><br />\r\n<a href=\"https://www.instagram.com/explore/tags/ketapangkalbar/\">#ketapangkalbar</a></p>\r\n', '2020-08-12 07:16:48', 0x6173736574732f6265726974612f633034393532383864333934346330353166313432623733643536653035633838313733306334633063643038323739653337356465633663316334613739642e6a7067, '#dpmptsp'),
(55, 'BUPATI KETAPANG TERIMA KUNJUNGAN DIREKTUR PT. CHEMONE', '<p>Setelah pelaksanaan Upacara 17 Agustus memperingati Hari Kemerdekaan Republik Indonesia ke-75, Bupati Ketapang menerima kunjungan Direktur PT. Chemone didampingi Kabid Pengembangan Penanaman Modal DPMPTSP.</p>\r\n\r\n<p>Dalam kunjungan tersebut, Direktur PT. Chemone memaparkan sedikit rencana investasi di Kabupaten Ketapang.</p>\r\n\r\n<p>Bupati Ketapang menyambut baik rencana investasi tersebut dan akan memfasilitasi pelaksanaan investasi tersebut agar berjalan dengan baik dan sesuai dengan aturan yang berlaku. &ldquo;Terlebih jika investasi ini terwujud akan memberikan multiplier effect terutama perekonomian masyarat Kabupaten Ketapang.&rdquo; papar Bupati Ketapang.</p>\r\n\r\n<p>Selanjutkan perusahaan akan melakukan ekspose rencana investasi kepada Bupati Ketapang dan Instansi terkait serta dihadiri oleh Pemerintah Provinsi Kalimantan Barat.</p>\r\n\r\n<p>Salah satu peran pemerintah dalam upaya meningkatkan pertumbuhan dan pembangunan ekonomi adalah dengan memastikan potensi daerah dikelola dan dimanfaatkan dengan baik.</p>\r\n\r\n<p>Ketapang Creating Future</p>\r\n', '2020-08-24 06:59:10', 0x6173736574732f6265726974612f386261303766383634646265653637613661336538306431643830323864616532666237333631346263323933313737313065316339393336663961636333622e6a7067, '#dpmptsp'),
(56, 'PANEN RAYA PADI 2020', '<p>Bupati Ketapang diwakili oleh Sekda Kab. Ketapang menghadiri Panen Raya Poktan Tunas Baru di Desa Sungai Bakau Kecamatan Matan Hilir Selatan.</p>\r\n\r\n<p>(21/8/2020)</p>\r\n\r\n<p>Ketapang Creating Future</p>\r\n', '2020-08-24 07:00:23', 0x6173736574732f6265726974612f386261303766383634646265653637613661336538306431643830323864616565316335393930633935396230303138316662633330626634396333643366322e6a7067, '#dpmptsp'),
(57, 'BUPATI BESERTA FORKOPIMDA TINJAU CITY MALL', '<p>Melihat perkembangan konfirmasi Covid-19, Bupati Ketapang beserta Forkopimda meninjau langsung Citimall Ketapang.</p>\r\n\r\n<p>Peninjauan ini untuk memastikan secara langsung pelaksanaan protokol kesehatan di Citimall Ketapang dilakukan dengan baik.</p>\r\n\r\n<p>(23/8/2020)</p>\r\n', '2020-08-24 07:05:31', 0x6173736574732f6265726974612f386261303766383634646265653637613661336538306431643830323864616534366461336238343062633337626330386130363563343135313637313163652e6a7067, '#dpmptsp'),
(58, 'EKSPOSE PT. CHEMONE', '<p>Minggu, 23 Agustus 2020<br />\r\nPT. ChemOne melakukan Ekspose Rencana Investasi di Kabupaten Ketapang.</p>\r\n\r\n<p>Dengan penerapan protokol kesehatan, acara ekspose rencana investasi PT. ChemOne dibuka langsung oleh Bupati Ketapang, dihadiri oleh Sekda Kabupaten Ketapang, Kepala Dinas Lingkungan Hidup dan Kehutanan Provinsi Kalimantan Barat, DPMPTSP Provinsi Kalimantan Barat, Tim Percepatan Pengembangan Investasi Kabupaten Ketapang serta Dinas Teknis terkait Kabupaten Ketapang.</p>\r\n\r\n<p>Pada dasarnya Pemerintah Kabupaten Ketapang menyambut baik rencana pembangunan industri oleh PT. chemOne di Kabupaten Ketapang dan mendukung penuh selama sesuai peraturan yang berlaku dan berpengaruh baik bagi kepentingan masyarakat terutama bagi peningkatan perekonomian masyarakat Kabupaten Ketapang</p>\r\n\r\n<p>Bupati Ketapang menyampaikan bahwa Kabupaten Ketapang telah membentuk Tim Percepatan Pengembangan Investasi Kabupaten Ketapang sebagai tanda keseriusan Kabupaten Ketapang untuk mengawal dan mendorong investasi berkembang dengan baik di Ketapang, sebagaimana arahan Presiden Joko Widodo dalam Rakornas Indonesia Maju di Sentul November 2019.</p>\r\n\r\n<p>Ketapang Creating Future<br />\r\n#ketapanginvestment<br />\r\n#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar&nbsp; @ Pendopo Rumah Dinas Bupati Ketapang</p>\r\n', '2020-08-26 01:46:48', 0x6173736574732f6265726974612f396135646162303835373738383034623835623063336163316632356533303038646237623861303032656466306238313833376231643334376133363537632e6a7067, '#dpmptsp'),
(59, 'Kunjungan Kerja Bupati Ketapang 24 sd 27 Agustus 2020', '<p>Beberapa dokumentasi kegiatan Kunjungan Kerja Bupati Ketapang, tanggal 24-27</p>\r\n\r\n<p>Ketapang Creating Future<br />\r\n#ketapang<br />\r\n#ketapangkalbar&nbsp;<br />\r\n#ketapanginvestment</p>\r\n', '2020-09-13 05:23:59', 0x6173736574732f6265726974612f636432356539303762346331616534343232653162366430313935643533663437353030626265376537393165326433613139663631636634336238376239392e6a7067, '#dpmptsp'),
(60, 'Pelantikan Drs Heronimus Tanam, ME Sebagai Pj.Sekda Ketapang', '<p>Jum&rsquo;at, 4 September 2020<br />\r\nBertempat di Kantor Bupati Ketapang, Bupati Ketapang melantik Drs. Heronimus Tanam, ME sebagai Penjabat Sekretaris Daerah Kabupten Ketapang dan dilanjutkan dengan Ramah Tamah Pelepasan Purna Tugas H. Farhan, SE, M.Si sebagai Sekretaris Daerah Kabupaten Ketapang.<br />\r\n#pemkabketapang</p>\r\n', '2020-09-13 05:35:02', 0x6173736574732f6265726974612f636432356539303762346331616534343232653162366430313935643533663466336566386337303237393765306166633330363461633063626661663864352e6a7067, '#dpmptsp'),
(61, 'Kunjungan Kerja Bupati  Ketapang 3 September 2020 di Sungai Melayu Rayak', '<p>Beberapa dokumentasi kegiatan Kunjungan Kerja Bupati Ketapang, tanggal 3 September 2020.</p>\r\n\r\n<p>Ketapang Creating Future<br />\r\n#ketapang<br />\r\n#ketapangkalbar&nbsp;<br />\r\n#ketapanginvestment</p>\r\n', '2020-09-13 05:43:45', 0x6173736574732f6265726974612f636432356539303762346331616534343232653162366430313935643533663462306333366339653936376132306164323962356438653236636232626339312e6a7067, '#dpmptsp'),
(62, 'Rapat Koordinasi Virtual Pusat dan Daerah', '<p>Rapat Koordinasi Virtual Pusat dan Daerah Dalam Rangka Percepatan Pelaksanaan Program Pertashop Kerjasama Kemendagri dengan Pertamina dipimpin langsung oleh Menteri Dalam Negeri.</p>\r\n\r\n<p>Dalam rapat tersebut disampaikan bahwa dalam rangkan meratakan kesediaan BBM ditingkat desa akan dibangun Pertashop, yang mana diharapkan seluruh stakeholder ditingkat pusat dan daerah mendukung dan memfasilitasi pembangunan tersebut.</p>\r\n\r\n<p>Target pembangunan pertashop tahun 2020 adalah sebanyak 4558 outlet pertashop dan realisasi saat ini sebanyak 576 outlet pertashop.<br />\r\nAdapun capaian ini belum maksimal dikarenakan terhambat oleh pandemi covid-19 saat ini.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2020-09-25 02:58:20', 0x6173736574732f6265726974612f393635353236333661333431326566333939646265623239656431393366326436663039353666616537646532313934646333306630646633363830376166632e6a7067, '#DMPTPSP'),
(63, 'Menjaga Imunitas tubuh, DPMPTSP SQUAD lakukan Lari Pagi bersama', '<p>Jum&rsquo;at, 11 September 2020<br />\r\n#dpmptsp<br />\r\n#laripagi</p>\r\n', '2020-09-25 03:00:45', 0x6173736574732f6265726974612f393635353236333661333431326566333939646265623239656431393366326464656339633536653734396431653535613865666264336663656166646166332e6a7067, '#DPMPTSP'),
(64, 'Rangkaian Susur Sungai dan Ziarah Akbar Astana Raja-raja Matan Tanjung Pura', '<p>&ldquo;Mengharap Berkah Menjunjung Petuah&rdquo;&nbsp; Desa Tanjungpura dengan potensi daerah yang ada diharapkan mampu lebih cepat berkembang terlebih merupakan daerah tujuan Wisata Religi. Mari kita bersama mempromosikannya, mengelola dan mengembangkannya&nbsp; Ketapang Creating Future #ketapanginvestment&nbsp; #Ketapang #ketapangkalbar</p>\r\n', '2020-09-25 03:02:59', 0x6173736574732f6265726974612f393635353236333661333431326566333939646265623239656431393366326438376331363965633935393436313539333962353930353731346533633335352e6a7067, '#DPMPTSP'),
(65, 'kunjungan Kerja Bupati Ketapang', '<p>Dalam Kunjungan Kerja Bupati Ketapang tanggal 19 September 2020 di Kecamatan Matan Hilir Selatan (MHS), Bupati Ketapang meresmikan RULAHU (Rumah Layak Huni) dan Pemberian Reward kepada BUMDes berprestasi di Kecamatan MHS.</p>\r\n\r\n<p>Pada acara tersebut, Bupati Ketapang Bapak Martin Rantan, SH, M.Sos menyampaikan bahwa disekitaran daerah RULAHU akan dibangun DEM AREA Ketahanan Pangan Pasca Covid-19, dan akan diikuti oleh beberapa kecamatan lain.</p>\r\n\r\n<p>Kedepan, diharapkan DEM AREA ini dapat dikelola dan dimanfaatkan sebaik-baiknya dan mampu menumbuhkan investasi-investasi baru yang pada akhirnya akan meningkatkan ekonomi masyarakat setempat.</p>\r\n\r\n<p>#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar</p>\r\n', '2020-09-29 02:29:57', 0x6173736574732f6265726974612f313234666438666433353534373036633864343264623065613134613363666334646532366131633061333631366663343531646130306334376265326161302e6a7067, '#Dpmptsp'),
(66, 'Pemantauan Pembangunan Smelter Line 2 PT. WHW', '<p>Sebagai wujud pelaksanaan fungsi pemerintahan dalam rangka pengendalian pelaksanaan penanaman modal, DPMPTSP Kab. Ketapang melakukan pemantauan pembangunan smelter line 2 PT. WHW. Kegiatan pemantau dilaksanakan pada Hari Selasa tanggal 13 Oktober 2020, bersamaan dengan pemeriksaan lapangan bersama Dinas PUTR terkait proses penerbitan Izin Mendirikan Bangunan. Kepala DPMPTSP Syamsul Islami didampingi Kepala Bidang Pengembangan Penanaman Modal Rio Marisa dan Kepala Bidang Pelayanan Perizinan Terpadu Agustina Clara menyampaikan bahwa Pemerintah Kabupaten Ketapang berkomitmen mendukung kegiatan investasi serta ikut serta mendorong, membantu/memfasilitasi agar kegiatan usaha yang ada di Kab. Ketapang dalam hal ini juga PT. WHW, maju, berkembang dan berjalan dengan baik, lancar sesuai dengan aturan yang berlaku. Dengan pembangunan Line 2 ini diharapkan ekonomi Masyarakat Kecamatan Kendawanagan pada khususnya dan Masyarakat Kabupaten Ketapang pada Umumnya juga mengalami peningkatan atau setidaknya stabil pada masa pandemi ini. Sebelum melaksanakan kegiatan seluruh tamu yang masuk dilakukan PCR Swab Test yang merupakan protokol kesehatan yang diterapkan oleh PT.WHW. Hadir pada kegiatan tersbut antara lain: Kepala DPMPTSP Kepala Dinas PUTR Kepala Bidang Pengembangan Penanaman Modal DPMPTSP Kepala Bidang Pelayanan Perizinan Terpadu DPMPTSP Kepala Bidang Cipta Karya Dinas PUTR beberapa staf DPMPTSP dan staf teknis Dinas PUTR. Ketapang Creating Future #ketapanginvestment #dpmptsp #ketapang #ketapangkalbar #ketapanginformasi</p>\r\n', '2020-10-14 11:12:17', 0x6173736574732f6265726974612f326238623937316666353465363261323863306639616232623338653330303464613866386564323836363064613930363162366466343163633037303464322e6a7067, '#dpmptsp'),
(67, 'Rapat Lanjutan Pembahasan Raperda Bersama DPRD Kabupaten Ketapang', '<p>Selasa, 13 Oktober 2020<br />\r\nPelaksanaan pembahasan Raperda Penanaman Modal akhirnya sampai pada kesepakatan dan akan segera dilakukan penetapan oleh DPRD Kabupaten Ketapang.<br />\r\nHadir pada rapat pembahasan tersebut antara lain:<br />\r\nSekretaris DPMPTSP Muhammad Israk<br />\r\nKasi Pengembangan Iklim Penanaman Modal Adi Syuriansyah<br />\r\nKasi Promosi Khadi Fitriadi<br />\r\nKasi Pengendalian Zairina<br />\r\nKasi Pelayanan Perizinan dan Non Perizinan Bid. B Ridhwan</p>\r\n\r\n<p>#ketapanginvestment&nbsp;<br />\r\n#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar</p>\r\n', '2020-10-14 11:14:26', 0x6173736574732f6265726974612f326238623937316666353465363261323863306639616232623338653330303463613832373638636535363936666331616534626566646362366562633438652e6a7067, '#dpmptsp'),
(68, 'Rapat Hasil Evaluasi  Pelayanan Publik Se kalimantan Barat', '<p>Pada hari Senin, 19 Oktober 2020<br />\r\nBiro Organisasi Provinsi Kalimantan Barat mengundang Seluruh Perangkat Daerah Pelayanan Publik se- Kalimantan Barat untuk melakukan<br />\r\nDalam rapat vidcom tersebut, Kepala Dinas Penanaman Modal dan Pelayanan Terpadu Satu Pintu diwakili oleh Kepala Bidang Pelayanan Perizinan Terpadu Agustina Clara.</p>\r\n\r\n<p>#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar</p>\r\n', '2020-10-19 10:14:51', 0x6173736574732f6265726974612f323930323839303230313632303065373233356135633664373831343537373564303961356266613535633966336435323439613665316337306139653063312e6a7067, '#dpmptsp'),
(69, 'Konsolidasi dan Pengarahan Terkait UU CIPTA KERJA oleh Kepala BKPM', '<p>Dalam rangka peningkatan pemahaman aparatur pemerintah khususnya pemerintah daerah, Kepala @bkpm_id (Badan Koordinasi Penanaman Modal) @bahlillahadalia melakukan konsolidasi dan pengarahan kepada seluruh Kepala DPMPTSP prov/kab/kota terkait UU Cipta Kerja.</p>\r\n\r\n<p>Selain menyampaikan poin-poin penyederhanaan perizinan berdasarkan UU Cipta Kerja yang baru-baru ini disahkan, Kepala BKPM juga menyampaikan informasi terkait pemberian DAK non fisik kepada seluruh DPMPTSP yang penggunaannya diantaranya untuk pemantauan dan pengawasan pelaksanaan penanaman modal didaerah, sebagaimana arahan Presiden Republik Indonesia Jokowidodo dalam rakor nasional penanaman modal februari 2020 yang lalu.</p>\r\n\r\n<p>Pengarahan tersebut dilaksanakan secara vidcom pada Hari Selasa, tanggal 20 Oktober 2020 dan dihadiri seluruh DPMPTSP prov/kab/kota.</p>\r\n\r\n<p>#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar<br />\r\n#bkpm</p>\r\n', '2020-10-22 01:32:46', 0x6173736574732f6265726974612f633633383266613233393731366333363465366534373163316136343833356134356132333137613736343438646434393737366139643034393536333163632e6a7067, '#dpmptsp'),
(70, 'kegiatan Pemantauan dan Pengawasan Pelaksanaan Penanaman Modal oleh DPMPTSP Kabupaten Ketapang', '<p>Dalam rangka melaksanakan fungsi pemerintah dibidang Penanaman Modal sebagaimana yang di atur dalam Peraturan BKPM Nomor 7 Tahun 2018 tentang Pedoman dan Tata Cara Pengendalian Pelaksanaan Penanaman Modal, memastikan kegiatan usaha melaksanakan kewajiban dan tanggung jawab serta mendapatkan hak sebagaimana yang diatur oleh Undang - Undang Nomor 25 Tahun 2007 Tentang Penanaman Modal, untuk itu DPMPTSP melaksanakan Pemantauan dan Pengawasan Pelaksanaan Penanaman Modal.</p>\r\n\r\n<p>Beberapa dokumentasi kegiatan Pemantauan dan Pengawasan Pelaksanaan Penanaman Modal oleh DPMPTSP Kabupaten Ketapang<br />\r\n3 s/d 5 November 2020</p>\r\n\r\n<p>Ketapang Creating Future<br />\r\nSelalu dengan Protokol Kesehatan<br />\r\n#ketapanginvestment <br />\r\n#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar</p>\r\n', '2020-11-16 04:10:33', 0x6173736574732f6265726974612f383661326632633435643236393936326662633265326136656663326161346665653039643065393237623666333132623036353332373165306230353531662e6a7067, '#dpmptsp'),
(71, 'Sosialisasi Peraturan Menteri PANRB no 23 Tahun 2017 melalui Video Conference.', '<p>DPMPTSP Kabupaten Ketapang mengikuti Sosialisasi Peraturan Menteri PANRB no 23 Tahun 2017 melalui Video Conference.<br />\r\nSemoga kedepan Ketapang mampu melaksanakan konsep Mal Pelayanan Publik, baik dengan bangunan baru atau dengan memanfaatkan bangunan yang sudah ada.</p>\r\n\r\n<p>Ketapang Creating Future<br />\r\n#ketapanginvestment&nbsp;<br />\r\n#dpmptsp<br />\r\n#ketapang<br />\r\n#ketapangkalbar</p>\r\n', '2020-11-16 06:39:57', 0x6173736574732f6265726974612f383661326632633435643236393936326662633265326136656663326161346665633034653865626261376531333230343365356234383332653534663037302e6a7067, '#dpmptsp');
