INSERT INTO `master_perizinan` (`id`, `perizinan`, `isi`, `created_at`, `updated_at`) VALUES
(2, 'IMB', '<ul>\r\n	<li>Bangunan Gedung adalah wujud fisik hasil pekerjaan konstruksi yang menyatu dengan tempat kedudukannya, sebagian atau seluruhnya berada di atas dan / atau di dalam tanah dan / atau air yang berfungsi sebagai tempat manusia melakukan kegiatannya, baik untuk hunian atau tempat tinggal, kegiatan keagamaan, kegiatan usaha, kegiatan sosial, budaya maupun kegiatan khusus.</li>\r\n	<li>Bangunan bukan gedung adalah suatu perwujudan fisik hasil pekerjaan konstruksi yang menyatu dengan tempat kedudukannya, sebagian atau seluruhnya berada di atas dan / atau di dalam tanah dan / atau air yang tidak digunakan untuk tempat hunian atau tempat tinggal.</li>\r\n	<li>Izin Mendirikan Bangunan yang selanjutnya disingkat IMB adalah perizinan yang diberikan oleh pemerintah daerah kepada pemohon untuk membangun baru, rehabilitasi/renovasi, dan / atau memugar dalam rangka melestarikan bangunan sesuai dengan persyaratan administratif dan persyaratan teknis yang berlaku.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PERSYARATAN</strong></p>\r\n\r\n<ol>\r\n	<li>BANGUNAN MAKSIMAL 2 LANTAI\r\n	<ul>\r\n		<li>Foto copy sertifikat tanah / SKT&nbsp;/ HGB / HGU</li>\r\n		<li>Foto copy KTP</li>\r\n		<li>Pas foto ukuran 3 x 4 &nbsp;3 (tiga) lembar &nbsp;</li>\r\n		<li>Materai Rp.6.000,- 3&nbsp;(tiga) lembar</li>\r\n		<li>Map merah 2 (dua) lembar</li>\r\n		<li>Gambar Teknis Bangunan</li>\r\n		<li>Foto copy PBB&nbsp;tahun terakhir</li>\r\n		<li>Rekomendasi Lurah/Kepala Desa (hanya untuk bangunan rumah tempat tinggal dan ruko maksimal 2 lantai)</li>\r\n	</ul>\r\n	</li>\r\n	<li>BANGUNAN KANTOR MILIK PEMERINTAH / SOSIAL / PENDIDIKAN / IBADAH / GUDANG / PENGINAPAN&nbsp;/&nbsp;PERUMAHAN / DERMAGA / TOWER / RUKO LII KE ATAS / HOTEL / SPBU / SPBE / SPDN / SUPERMARKET / MALL / FASILITAS PERUSAHAAN + POIN 1\r\n	<ul>\r\n		<li>Rekomendasi Lurah / Kepala Desa diketahui Camat</li>\r\n		<li>Rekomendasi tata ruang dari Dinas Pekerjaan Umum</li>\r\n		<li>SPPL / UKL - UPL / AMDAL</li>\r\n		<li>Foto copy akte perusahaan</li>\r\n		<li>Rekomendasi Dinas Perhubungan dan Bandara&nbsp;</li>\r\n		<li>Foto copy izin lokasi (terbaru / yang sudah diperpanjang)</li>\r\n		<li>Foto copy izin usaha perkebunan (IUP)</li>\r\n		<li>Surat Pernyataan bersedia Menyerahkan Fasilitas Sosial dan Umum kepada Pemerintah</li>\r\n	</ul>\r\n	</li>\r\n	<li>PEMUTIHAN\r\n	<ul>\r\n		<li>Foto copy sertifikat tanah / SKT</li>\r\n		<li>Foto copy KTP&nbsp;yang masih berlaku</li>\r\n		<li>Pas foto ukuran : 3 x 4 = 2 lembar</li>\r\n		<li>Foto copy pbb tahun terakhir</li>\r\n		<li>Materai Rp. 6.000,- dua (2) lembar</li>\r\n		<li>Surat keterangan dari Lurah atau Kepala Desa yang menerangkan bahwa bangunan telah berdiri sejak tahun&nbsp;2000 kebawah</li>\r\n		<li>Foto bangunan berwarna tampak depan, belakang, samping</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n', NULL, NULL),
(4, 'Izin Reklame', '<p><strong>PERSYARATAN PERMOHONAN BARU</strong></p>\r\n\r\n<ol>\r\n	<li>MENGISI FORMULIR PERMOHONAN BERTMATRAI RP. 6.000,-.</li>\r\n	<li>FOTOKOPI KTP PEMOHON.</li>\r\n	<li>FOTOKOPI AKTA PENDIRIAN PERUSAHAAN (BAGI PERUSAHAAN YANG BERSTATUS BADAN HUKUM/BADAN USAHA).</li>\r\n	<li>FOTOKOPI STATUS KEPEMILIKAN TANAH/BANGUNAN TEMPAT USAHA (PERJANJIAN SEWA MENYEWA KONTRAK PINJAMAN/SERTIFIKAT DAN SEJENISNYA).</li>\r\n	<li>SURAT PERSETUJUAN DARI PEMILIK PERSIL BAGI REKLAME YANG TERLETAK DI ATAS TANAH / BANGUNAN MILIK SWASTA / PERORANGAN.</li>\r\n	<li>SKETSA TITIK LOKASI PENYELENGGARAAN REKLAME.</li>\r\n	<li>DESAIN DAN TIPOLOGI REKLAME.</li>\r\n	<li>MAP MERAH DAN MATRAI 6000 2 LEMBAR.</li>\r\n	<li>SURAT KUASA DARI PEMOHON APABILA PENGAJUAN PERMOHONAN DIKUASAKAN PADA PIHAK LAIN.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PERSYARATAN PERPANJANGAN</strong></p>\r\n\r\n<ol>\r\n	<li>MENGISI FORMULIR PERMOHONAN BERTMATRAI RP. 6.000,-.</li>\r\n	<li>IZIN REKLAME YANG SUDAH ADA (ASLI).</li>\r\n	<li>TANDA BUKTI LUNAS PEMBAYARAN PAJAK REKLAME TAHUN BERJALAN.</li>\r\n	<li>MAP MERAH DAN MATERAI 6000 2 LEMBAR.</li>\r\n</ol>\r\n', NULL, NULL),
(7, 'Izin Kesehatan', '<p>Izin Gangguan adalah pemberian Izin Tempat Usaha kepada seseorang dan atau Badan Hukum di lokasi tertentu yang dapat menimbulkan bahaya, kerugian dan gangguan tidak termasuk tempat usaha yang lokasinya telah ditunjuk oleh Pemerintah Daerah.</p>\r\n\r\n<p><strong>PERSYARATAN</strong></p>\r\n\r\n<ol>\r\n	<li>Surat Izin Praktik Dokter / Dokter Gigi\r\n	<ul>\r\n		<li>&nbsp; &nbsp;&nbsp; Surat Permohonan</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Fotokopi Ktp</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Fotokopi STR</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Fotocopy Ijasah Legalisir</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Surat Keterangan Sehat Fisik dari dokter yang memiliki Surat Izin Praktik</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Surat Pernyataan memiliki Tempat Praktik dari Pemohon</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Surat persetujuan atasan langsung bagi Dokter dan Dokter Gigi yang bekerja pada instansi/fasilitas pelayanan&nbsp; kesehatan pemerintah atau pada instansi / fasilitas pelayanan kesehatan lain secara purna waktu</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Surat Rekomendasi dari organisasi profesi, sesuai tempat praktik;</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Pas Foto berwarna ukuran 4 x 6 cm sebanyak 3 ( tiga ) lembar dan 3 x 4 sebanyak 2 (dua) lembar.</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Map Hijau (2 Lembar)</li>\r\n	</ul>\r\n	</li>\r\n	<li>Surat Izin Kerja Bidan / Praktik Bidan\r\n	<ul>\r\n		<li><img src=\"file:///C:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif\" style=\"height:15px; width:19px\" />Fotokopi KTP</li>\r\n		<li><img src=\"file:///C:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image002.gif\" style=\"height:15px; width:19px\" />Fotokopi STRB dilegalisasi.</li>\r\n		<li><img src=\"file:///C:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image003.gif\" style=\"height:15px; width:19px\" />Fotocopy Ijasah Legalisir.</li>\r\n		<li><img src=\"file:///C:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image004.gif\" style=\"height:14px; width:19px