:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image006.gif\" style=\"height:15px; width:19px\" />Surat keterangan dari pimpinan Fasilitas Pelayanan Kesehatan tempat Perawat akan berpraktik.</li>\r\n		<li><img src=\"file:///C:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image007.gif\" style=\"height:15px; width:19px\" />Pas Foto berwarna 4x6 cm sebanyak 3 (tiga) lembar.</li>\r\n		<li><img src=\"file:///C:/Users/User/AppData/Local/Temp/msohtmlclip1/01/clip_image008.gif\" style=\"height:15px; width:19px\" />Rekomendasi dari kepala dinas kesehatan ; (Perawat Mandiri).</li>\r\n		<li>&nbsp; &nbsp;&nbsp; Rekomendasi dari Organisasi Profesi</li>\r\n	</ul>\r\n	</li>\r\n	<li>Surat Izin Klinik Kesehatan (Balai Pengobatan, Klinik Bersalin)\r\n	<ul>\r\n		<li>Pemohon dari pemilik sarana</li>\r\n		<li>Untuk pemohon yang berbentuk Yayasan / Perusahaan harus melampirkan akte pendirian yayasan / perusahaan</li>\r\n		<li>KTP pemohon</li>\r\n		<li>Bukti kepemilikan bangunan kesehatan (untuk bangunan yag berupa kontrakan harus dilengkapi dengan perjanjian kontrak bangunan)</li>\r\n		<li>Surat Izin Tempat Usaha Klinik Kesehatan</li>\r\n		<li>Rekomendasi dari pemerintah setempat (RT, RW, Kepala Desa / Lurah, Camat)</li>\r\n		<li>Rekomendasi dari Kepala Puskesmas terdekat</li>\r\n		<li>Surat pernyataan bermaterai &nbsp;kesanggupan dari penanggungjawab teknis medis (dokter)</li>\r\n		<li>Surat perjanjian kerjasama pemilik klinik dan dokter penanggungjawab teknis media</li>\r\n		<li>Surat izin praktik dokter</li>\r\n		<li>Ijazah perawat / bidan</li>\r\n		<li>Daftar peralatan dan daftar obat - obatan</li>\r\n		<li>Daftar ketenagaan</li>\r\n		<li>Denah ruangan</li>\r\n		<li>Denah lokasi</li>\r\n		<li>Surat pernyataan bermaterai akan mematuhi peraturan perundang-undangan yang berlaku</li>\r\n		<li>Surat pernytaaan telah memiliki sistim pengolahan limbah</li>\r\n		<li>Pas foto ukuran 4 x 6 sebbanyak 2 (dua) lembar</li>\r\n	</ul>\r\n	</li>\r\n	<li>Izin Apotek\r\n	<ul>\r\n		<li>Surat