(10, 'Izin Tempat Penyimpanan Sementara Limbah Bahan Berbahaya dan Beracun (TPSLB3)', '<p>Persyaratan Izin TPSLB3 :</p>\r\n\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mengisi Formulir Surat Permohonan Perizinan bermaterai 6000</p>\r\n\r\n<p>2. &nbsp; &nbsp;&nbsp; Persyaratan Administrasi :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FC NIB &amp; KTP</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fotokopi Izin Lokasi Kegiatan</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FC Izin Kelayakan Lingkungan / Izin Lingkungan</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Izin Usaha Kegiatan / IUP</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; e.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Izin Mendirikan Bangunan (TPS LB3)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; f.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FC SIUP (Surat Izin Usaha Perdagangan)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; g.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FC Kontrak Kerjasama dengan Pihak ke-3 (pengelola LB3)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; h.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FC Legalitas pihak ke-3 (Pengelola LB3)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Uraian Proses Produksi dengan Mengidentifikasi Sumber Penghasil Jenis, Jumlah dan Karakteristik Limbah yang dikelola &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (Neraca LB3)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; j.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SOP Penyimpanan LB3</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; k.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SOP Tanggap Darurat LB3</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; l. &nbsp; &nbsp; &nbsp; Perlengkapan Sistem Tanggap Darurat</p>\r\n\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Persyaratan Teknis ; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peta Lokasi Kegiatan (cantumkan koordinat geografis lokasi TPS LB3)&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LayOut Area Kegiatan (Cantumkan Lokasi TPS LB3)&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LayOut TPS LB3</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desain Konstruksi TPS LB3 Berkala</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; e.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tata Letak Saluran Drainase</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; f.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Photo Penataan Kemasan LB3</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; g.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Photo Kondisi Fisik TPS LB3</p>\r\n', NULL, NULL),
(11, 'Izin Ligkungan', '<p>Persyaratan IUP dan Revisi IUP :</p>\r\n\r\n<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<ol>\r\n				<li>Surat Permohonan IUP atau Revisi IUP;</li>\r\n				<li>Profil Perusahaan meliputi Akta Pendirian dan Perubahan terakhir yang telah terdaftar di Kementrian Hukum dan Hak Asasi Manusia, komposisi kepemilikan saham, susunan pengurus dan bidang usaha perusahaan;</li>\r\n				<li>Nomor Pokok Wajib Pajak;</li>\r\n				<li>Rekomendasi kesesuaian dengan Perencanaan Pembangunan Perkebunan kabupaten / kota dari Bupati / walikota untuk IUP yang diterbitkan oleh gubernur;</li>\r\n				<li>Rekomendasi kesesuaian dengan Perencanaan Pembangunan Perkebunan Provinsi dari gubernur untuk IUP yang diterbitkan oleh Bupati / Walikota;</li>\r\n				<li>Izin Lokasi dari bupati / walikota yang dilengkapi dengan peta digital calon lokasi dengan skala 1:100.000 atau 1:50.000 (cetak peta dan file elektronik) sesuai dengan peraturan perundang-undangan dan tidak terdapat izin yang diberikan pada pihak lain;</li>\r\n				<li>Pertimbangan teknis ketersediaan lahan dari dinas yang membidangi kehutanan, apabila areal yang diminta berasal dari kawasan hutan;</li>\r\n				<li>Jaminan pasokan bahan baku dengan menggunakan format seperti tercantum dalam Lampiran IV dan Lampiran XII yang merupakan bagian tidak terpisahkan dari Permenta No. 98 Tahun 2013.</li>\r\n				<li>Rencana Kerja pembangunan kebun dan unit pengolahan hasil perkebunan termasuk rencana fasilitasi pembangunan kebun untuk masyarakat sekitar;</li>\r\n				<li>Izin Lingkungan dari gubernur atau bupati / walikota sesuai kewenangan;</li>\r\n				<li>Asli surat pernyataan dukungan dari Kepala Desa, tokoh masyarakat, temenggung yang diketahui oleh Camat setempat;</li>\r\n				<li>Asli surat pernyataan dukungan dari Dewan Adat Dayak (DAD) setempat;</li>\r\n				<li>Asli surat pernyataan dukungan dari Majlis Adat Budaya Melayu (MABM) setempat;</li>\r\n				<li>Pernyataan kesangupan; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n			</ol>\r\n\r\n			<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; a.&nbsp; Memiliki sumber daya manusia, sarana, prasarana dan sistem untuk melakukan pengendalian organisasi pengganggu tanaman &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (OPT);&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n			<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; b.&nbsp; Memiliki sumber daya manusia, sarana, prasarana dan sistem untuk melakukan pembukaan lahan tanpa bakar serta &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; pengendalian kebakaran;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n			<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; c.&nbsp; Memfasilitasi pembangunan kebun untuk masyarakat sekitar yang dilengkapi dengan rencana kerja dan rencana pembiayaan; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; d.&nbsp; Melaksanakan kemitraan dengan Pekebun, karyawan dan Masyarakat Sekitar perkebunan;</p>\r\n\r\n			<p>&nbsp; &nbsp; 15.&nbsp; Keputusan Izin Usaha Perkebunan sebelumnya (khusus untuk revisi IUP)</p>\r\n\r\n			<p>&nbsp; &nbsp; 16.&nbsp; Map Biola 2 buah (HIJAU).</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL, NULL);
