INSERT INTO `pages` (`id`, `judul`, `isi`, `created_at`, `updated_at`) VALUES
(2, 'Profil Kantor', '<p>Keberadaan Kantor Pelayanan Terpadu Kabupaten Ketapang merupakan unsur pelaksanaan tugas tertentu Pemerintah Kabupaten Ketapang sesuai dengan Peraturan Daerah Kabupaten Ketapang Nomor 12 tahun 2008 tentang pembentukan kantor Pelayanan Terpadu Kabupaten Ketapang. Tugas Pokok Kantor Pelayanan Terpadu Kabupaten Ketapang adalah membantu Bupati dibidang Pelayanan Perizinan dan Non - Perizinan. Dalam melaksanakan tugas pokok, Kantor Pelayanan Terpadu mempunyai fungsi : Penyusunan perencanaan dibidang pelayanan administrasi perizinan dan non -perizinan terpadu. Perumusan kebijakan teknis dibidang pelayanan administrasi perizinan dan non - perizinan terpadu. Penyelenggaraan urusan pemerintahan dan pelayanan umum dibidang pelayanan administrasi perizinan dan non - perizinan. Pelaksanaan pembinaan koordinasi, pengendalian dan fasilitas pelaksanaan kegiatan dibidang pelayanan administrasi perizinan dan non - perizinan terpadu. Pelaksanaan tugas kedinasan lainya yang diberikan oleh Bupati sesuai dengan tugas dan fungsi.</p>\r\n', NULL, NULL),
(3, 'Visi Misi', '<p><strong>Visi</strong></p>\r\n\r\n<p><strong>&rdquo;<em>TERWUJUDNYA PELAYANAN&nbsp;PRIMA YANG PROFESIONAL</em>&rdquo;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Misi</strong></p>\r\n\r\n<ol>\r\n	<li>Meningkatkan tertib administrasi;</li>\r\n	<li>Mengembangkan sistem pelayanan berbasis informasi teknologi;</li>\r\n	<li>Meningkatkan kompetensi dan profesionalisme aparatur pelaksana pelayanan;</li>\r\n	<li>Meningkatkan penanganan pengaduan masyarakat, sesuai dengan peraturan perundang-undangan yang berlaku;</li>\r\n	<li>Melaksanakan pengolahan data untuk tersedianya arsip dokumen perizinan yang otentik;</li>\r\n	<li>Meningkatkan kualitas pelayanan yang ( CERMAT ) cepat, ramah, mudah, adil dan transparan.</li>\r\n</ol>\r\n', NULL, NULL),
(4, 'Struktur Organisasi', '<p><a href=\"https://drive.google.com/file/d/1431__bNx9GjE4EeQWw6kLe6ts64upbuG/view?usp=sharing\">https://drive.google.com/file/d/1431__bNx9GjE4EeQWw6kLe6ts64upbuG/view?usp=sharing</a></p>\r\n', NULL, NULL),
(5, 'Maklumat Pelayanan DPMPTSP', '<h2 style=\"font-style:italic;\"><strong>&quot;DENGAN INI KAMI MENYATAKAN SANGGUP MENYELENGGARAKAN PELAYANAN SESUAI STANDAR PELAYANAN YANG TELAH DITETAPKAN DAN APABILA TIDAK MENEPATI JANJI INI, KAMI SANGGUP MENERIMA SANKSI SESUAI PERATURAN PERUNDANG-UNDANGAN YANG BERLAKU&quot;</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 style=\"font-style:italic;\"><em><strong>LANSIA, IBU HAMIL DAN MENYUSUI DIDAHULUKAN</strong></em></h2>\r\n', NULL, NULL),
(6, 'Standar Operasional Prosedur', '<p><a href=\"https://drive.google.com/file/d/15mp948oEshtKL0KGs0A7njd81O2trCdv/view?usp=sharing\">https://drive.google.com/file/d/15mp948oEshtKL0KGs0A7njd81O2trCdv/view?usp=sharing</a></p>\r\n', NULL, NULL);
